"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[1477],{10:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"supabase_tutorial_practice","metadata":{"permalink":"/blog/supabase_tutorial_practice","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2024-01-16-supabase_tutorial_practice/2024-01-16-supabase_tutorial_practice.md","source":"@site/blog/2024-01-16-supabase_tutorial_practice/2024-01-16-supabase_tutorial_practice.md","title":"Supabase\ub780 \ubb34\uc5c7\uc778\uac00? \uc6f9\ud398\uc774\uc9c0 SELECT, INSERT \uc2e4\uc2b5","description":"Supabase\ub780 \ubb34\uc5c7\uc778\uac00? \uc6f9\ud398\uc774\uc9c0 SELECT, INSERT \uc2e4\uc2b5","date":"2024-01-16T00:00:00.000Z","formattedDate":"2024\ub144 1\uc6d4 16\uc77c","tags":[{"label":"supabase","permalink":"/blog/tags/supabase"},{"label":"postgreSQL","permalink":"/blog/tags/postgre-sql"},{"label":"insert","permalink":"/blog/tags/insert"},{"label":"select","permalink":"/blog/tags/select"},{"label":"firebase","permalink":"/blog/tags/firebase"},{"label":"data","permalink":"/blog/tags/data"}],"readingTime":8.885,"hasTruncateMarker":false,"authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"frontMatter":{"slug":"supabase_tutorial_practice","title":"Supabase\ub780 \ubb34\uc5c7\uc778\uac00? \uc6f9\ud398\uc774\uc9c0 SELECT, INSERT \uc2e4\uc2b5","authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"tags":["supabase","postgreSQL","insert","select","firebase","data"]},"unlisted":false,"nextItem":{"title":"\ud3f4\ub9ac\uc6c0\uc758 key_on \ud30c\ub77c\ubbf8\ud130\uc640 GeoJson \ubc0f GeoData \uc774\ud574\ud558\uae30","permalink":"/blog/features_collection"}},"content":"## Supabase\ub780 \ubb34\uc5c7\uc778\uac00? \uc6f9\ud398\uc774\uc9c0 SELECT, INSERT \uc2e4\uc2b5\\n\\n### \ubaa9\uc801\\n\\n- Supabase\ub780 \ubb34\uc5c7\uc778\uac00?\\n  - Firebase\uc640\uc758 \ucc28\uc774\uc810\uc740 \ubb34\uc5c7\uc778\uac00?\\n- \uc6f9\ud398\uc774\uc9c0\uc5d0\uc11c \ub370\uc774\ud130\ub97c \ubd88\ub7ec\uc624\uace0 \uc0bd\uc785\ud558\uae30\\n  - \uad6c\ud604\ud558\uace0\uc790 \ud558\ub294 \ucf54\ub4dc\\n  - \ubc1c\uc0dd\ud55c \ubb38\uc81c\\n\\n## \uc0dd\ud65c\ucf54\ub529\uc758 [Supabase \uc785\ubb38\uc218\uc5c5 - YouTube](https://www.youtube.com/watch?v=FbLzqoENTsg)\ub97c \uc2e4\uc2b5\ud588\uc2b5\ub2c8\ub2e4.\\n\\n- \ubd80\ub52a\ud614\ub358 \ubb38\uc81c\uc640 \ud574\uacb0\ubc95\uc744 \uacf5\uc720\ud569\ub2c8\ub2e4.\\n\\n## Supabase\ub780 \ubb34\uc5c7\uc778\uac00?\\n\\n- \uc6f9\uacfc \uc571\uc758 \ubc31\uc564\ub4dc\ub97c \uad6c\ud604\ud558\uae30 \uc704\ud55c \ubaa8\ub4e0 \uae30\ub2a5\uc744 \uc81c\uacf5\ud558\ub294 \ud074\ub77c\uc6b0\ub4dc \uc11c\ube44\uc2a4\\n- \ub370\uc774\ud130\ubca0\uc774\uc2a4 : \ub370\uc774\ud130\uac00 \ubaa8\uc5ec\uc838 \uc788\ub294 \uacf5\uac04\uc73c\ub85c \uad6c\uc870\uc801\uc778 \ubc29\uc2dd\uc73c\ub85c \uad00\ub9ac\ub418\ub294 \ub370\uc774\ud130\ub4e4\uc758 \uc9d1\ud569\\n- \uc2a4\ud1a0\ub9ac\uc9c0 : \uc5c5\ub85c\ub4dc\ub41c \ud30c\uc77c\uc744 \uc800\uc7a5\\n- \uc778\uc99d\uae30\ub2a5 : \ud68c\uc6d0\uac00\uc785 \ubc0f \ub85c\uadf8\uc778, \ub85c\uadf8\uc544\uc6c3 \ub4f1\\n- Edge Function : \ud504\ub85c\uadf8\ub798\ubc0d\uc801\uc73c\ub85c \ub2e4\uc591\ud55c \uae30\ub2a5 \ucc98\ub9ac (\uc7a5\uace0, FastAPI \ub4f1\uc774 \uc218\ud589\ud558\ub358)\\n\\n### \uad6c\uae00\uc758 Firebase\uc640\uc758 \ucc28\uc774\uc810\\n\\n- Supabase\ub294 \ub370\uc774\ud130\ubca0\uc774\uc2a4\ub97c \uad00\uacc4\ud615 \ub370\uc774\ud130\ubca0\uc774\uc2a4\uc778 PostgreSQL\uc744 \uc0ac\uc6a9\ud569\ub2c8\ub2e4.\\n\\n## Supabase\uc758 \uacc4\uce35\\n\\n![](https://i.imgur.com/VZY2ILh.png)\\n\\n1. \uacc4\uc815 (Account)\\n2. \uc870\uc9c1 (Organizations)\\n3. \ud504\ub85c\uc81d\ud2b8 (Projects)\\n   - \ub370\uc774\ud130\ubca0\uc774\uc2a4\\n   - \uc2a4\ud1a0\ub9ac\uc9c0\\n   - \uc778\uc99d\uae30\ub2a5\\n   - Edge functions\\n\\n## \uc2e4\uc2b5\uc5d0\uc11c \ub9cc\ub4e4\uace0\uc790 \ud558\ub294 \uc11c\ube44\uc2a4\\n\\n- \uc288\ud30c\ubca0\uc774\uc2a4\ub97c \ud1b5\ud574 \ub370\uc774\ud130\ubca0\uc774\uc2a4\ub97c \uad6c\ucd95\ud55c\ub2e4.\\n  - title(text), body(text), create_at(date), id(int8) \uceec\ub7fc\uc744 \ub9cc\ub4e0\ub2e4.\\n- \uc6f9\ud398\uc774\uc9c0\ub97c \ud1b5\ud574 \uad6c\ucd95\ub41c \ub370\uc774\ud130\ubca0\uc774\uc2a4\uc5d0\uc11c \ubd88\ub7ec\uc640 \ub80c\ub354\ub9c1\ud55c\ub2e4.\\n- \uc6f9\ud398\uc774\uc9c0\uc758 \'Create\' \ubc84\ud2bc\uc744 \uc774\uc6a9\ud574\uc11c \uc0c8\ub85c\uc6b4 \'title\'\uacfc \'body\'\ub97c \uc785\ub825\ubc1b\uc544 \ub370\uc774\ud130\ubca0\uc774\uc2a4\ub85c \uc2e0\uaddc \ub370\uc774\ud130\ub85c \ucd94\uac00\ud55c\ub2e4.\\n\\n![](https://i.imgur.com/OjScxnD.png)\\n\\n### 1. Supabase \uac00\uc785\ud558\uae30\\n\\n![](https://i.imgur.com/eefXkLv.png)\\n\\n- \uc6f9\ud398\uc774\uc9c0\uc5d0 \ub4e4\uc5b4\uac00\uba74, \ub098\uc624\ub294 \ub300\ubb38 \ub0b4\uc6a9\uc774 \uc544\uc8fc \ub9d8\uc5d0\ub4e0\ub2e4.\\n\\n  - \uc77c\uc8fc\uc77c\uc548\uc5d0 \ub9cc\ub4e4\uc5b4\uc11c, \uc218\ubc31\ub9cc\uc5d0\uac8c \ubc30\ud3ec\ud558\uae30\\n\\n- \ud68c\uc6d0\uac00\uc785\uc744 \ud574\ubcf4\uc790.\\n  ![](https://i.imgur.com/BDrXTjX.png)\\n- \ub098\ub294 GitHub\uc73c\ub85c \ud68c\uc6d0\uac00\uc785\ud588\ub2e4.\\n\\n### 2. \ud504\ub85c\uc81d\ud2b8 \ub9cc\ub4e4\uae30\\n\\n![](https://i.imgur.com/BBHoA3p.png)\\n\\n- \ud504\ub85c\uc81d\ud2b8\ub97c \uc2dc\uc791\ud558\uae30 \uc704\ud574\uc11c \'Start your project\' \ubc84\ud2bc\uc744 \ub20c\ub7ec\ubcf4\uc790.\\n- \uadf8\ub7ec\uba74 \uc544\ub798\uc640 \uac19\uc740 \ub300\uc26c\ubcf4\ub4dc\uac00 \ub098\ud0c0\ub09c\ub2e4.\\n\\n![](https://i.imgur.com/cQ2iBwd.png)\\n\\n- \uc774\ub984\uc744 \uc0ac\uc6a9\ud55c \uae30\ubcf8\uac12 \uc870\uc9c1\uc774 \uc0dd\uc131\ub418\uc5b4 \uc788\uc744 \uac83\uc774\ub2e4. \uc774 \uc870\uc9c1 \uc548\uc5d0 \'New Project\' \ubc84\ud2bc\uc744 \ub20c\ub7ec\ubcf4\uc790.\\n\\n![](https://i.imgur.com/Mn8vMqw.png)\\n\\n- \ud504\ub85c\uc81d\ud2b8 \uc0c1\uc704 \uc870\uc9c1\uc744 \uc9c0\uc815\ud55c\ub2e4.\\n- \ud504\ub85c\uc81d\ud2b8 \uc774\ub984\uc744 \uc815\ud558\uace0\\n- PostgreSQL\uc758 \ub370\uc774\ud130\ubca0\uc774\uc2a4\uc758 \uc554\ud638\ub97c \uc785\ub825\ud55c\ub2e4.\\n  - \ub098\ub294 \uc0dd\uc131\uae30\ub97c \ud1b5\ud574\uc11c \uc0dd\uc131\ud588\ub2e4. (\ub530\ub85c \uc800\uc7a5\ud574\ub450\uace0 \uc0ac\uc6a9\ud560 \uc77c\uc744 \uac70\uc758 \uc5c6\ub2e4\uace0 \ud55c\ub2e4.)\\n- Region\uc740 \uc11c\ube44\uc2a4\uac00 \ubc30\ud3ec\ub420 \uc9c0\uc5ed\uacfc \uac00\uae4c\uc6b4 \uacf3\uc73c\ub85c \uc124\uc815\ud558\uc790.\\n  - \ub098\ub294 \ud55c\uad6d\uc5d0 \uc11c\ube44\uc2a4\ub97c \ud574\uc57c\ud558\ub2c8, \uc11c\uc6b8\ub85c \uc815\ud55c\ub2e4.\\n- \uc704 \ub0b4\uc6a9\ub4e4\uc744 \uc124\uc815\ud558\uba74 \uc774\uc81c \ud504\ub85c\uc81d\ud2b8\uac00 \ub9cc\ub4e4\uc5b4\uc84c\ub2e4.\\n\\n### 3. \ub370\uc774\ud130 \uc785\ub825\ud558\uae30\\n\\n![](https://i.imgur.com/cjHpJ8u.png)\\n\\n- \ud504\ub85c\uc81d\ud2b8 \uc0dd\uc131\uc744 \ub9c8\uce58\uba74, \uc704\uc640 \uac19\uc774 \ub300\uc26c\ubcf4\ub4dc\uac00 \ubcf4\uc785\ub2c8\ub2e4.\\n- \ud14c\uc774\ube14 \ub370\uc774\ud130\ub97c \ub9cc\ub4e4\uc5b4\uc8fc\uae30 \uc704\ud574\uc11c \'\ud14c\uc774\ube14 \uc5d0\ub514\ud130\' \ubc84\ud2bc\uc744 \ub20c\ub7ec\uc90d\ub2c8\ub2e4.\\n\\n![](https://i.imgur.com/8p95VR0.png)\\n\\n- \'New table\' \ubc84\ud2bc\uc744 \ub20c\ub7ec \uc0c8 \ud14c\uc774\ube14\uc744 \ub9cc\ub4ed\uc2dc\ub2e4.\\n\\n![](https://i.imgur.com/3ZZnWex.png)\\n\\n- \uae30\ubcf8\uac12\uc73c\ub85c\ub294 \'RLS\'\uac00 \ud65c\uc131\ud654 \ub418\uc5b4\uc788\ub2e4.\\n\\n![](https://i.imgur.com/hlzJLYv.png)\\n\\n- \ucc98\uc74c\uc5d0 RLS\ub97c \uccb4\ud06c\ub97c \ud574\uc81c\ud558\uace0 \uc544\ub798\uc640 \uac19\uc774 \'page\' \ud14c\uc774\ube14\uc744 \ub9cc\ub4e4\uc5c8\ub2e4.\\n\\n![](https://i.imgur.com/bGBVF2L.png)\\n\\n- \uc774\ub807\uac8c \ub9cc\ub4e0 \ud14c\uc774\ube14\uc740 \ub204\uad6c\ub098\uc5d0\uac8c \uc811\uadfc\uc774 \uac00\ub2a5\ud558\uac8c \ub41c\ub2e4\uace0 \uacbd\uace0\uac00 \ub098\uc628\ub2e4.\\n  - RLS\uc744 \ud65c\uc131\ud654 \ud558\uc9c0 \uc54a\uc544\uc11c \uadf8\ub807\ub2e4.\\n\\n![](https://i.imgur.com/gvv9342.png)\\n\\n- \'Insert\' \ubc84\ud2bc\uc744 \ub204\ub974\uace0, \'Insert row\'\ub97c \ub20c\ub7ec \ub370\uc774\ud130\ub97c \ucd94\uac00\ud574\ubcf4\uc790.\\n\\n![](https://i.imgur.com/kpDXNDl.png)\\n\\n- \'id\'\uc640 \'create_at\'\uc740 \uc790\ub3d9\uc73c\ub85c \uc785\ub825\ub41c\ub2e4.\\n- \uc120\ud0dd \uc601\uc5ed\uc778 \'title\'\uacfc \'body\'\ub97c \uc608\uc2dc\ub85c \uc785\ub825\ud558\uace0 \uc800\uc7a5\ud574\ubcf4\uc790.\\n\\n![](https://i.imgur.com/7FQrdn0.png)\\n\\n- \'id\'\uac12\uc774 1\uc778 \ub370\uc774\ud130\uac00 \ud558\ub098 \ub9cc\ub4e4\uc5b4\uc84c\ub2e4.\\n\\n### 4. \uc6f9\uc11c\ube44\uc2a4\uc640 \uc5f0\uacb0\ud558\uae30\\n\\n- \uc6f9\ud398\uc774\uc9c0\uc640 \ub370\uc774\ud130\ubca0\uc774\uc2a4\ub97c \uc5f0\uacb0\ud55c \uc11c\ube44\uc2a4\ub97c \ub9cc\ub4e0\ub2e4\uace0 \uac00\uc815\ud574\ubcf4\uc790.\\n- \uc644\uc131\ub41c \uc608\uc2dc \ucf54\ub4dc\ub97c \uba3c\uc800 \ud6d1\uc5b4\ubcf4\uc790.\\n\\n```html\\n<!DOCTYPE html>\\n<html>\\n  <head>\\n    <meta charset=\\"utf-8\\" />\\n    <meta name=\\"viewport\\" content=\\"width=device-width\\" />\\n    <script src=\\"https://cdn.jsdelivr.net/npm/@supabase/supabase-js@2\\"><\/script>\\n    <title>JS Bin</title>\\n  </head>\\n  <body>\\n    <h1>Supatodo</h1>\\n    <div id=\\"history\\"></div>\\n    <input type=\\"button\\" value=\\"create\\" id=\\"create_btn\\" />\\n\\n    <script>\\n      const supabaseUrl = API\uc758 url\\n      const supabaseKey = API\uc758 key\\n      const client = supabase.createClient(supabaseUrl, supabaseKey)\\n        async function refreshHistory() {\\n        let { data: record, error } = await client.from(\'page\').select(\'*\');\\n        console.log(\'record\', record);\\n        let tag = \\"\\";\\n        for (let i = 0; i < record.length; i++) {\\n          tag += `<h2>${record[i].title}</h2>${record[i].body}`;\\n        }\\n        document.querySelector(\'#history\').innerHTML = tag;\\n        }\\n      refreshHistory()\\n\\n      async function recordHandler() {\\n        const { data, error } = await client\\n      .from(\'page\')\\n      .insert([\\n        { title: prompt(\\"title?\\"), body: prompt(\\"body?\\") }\\n      ]).select()\\n        refreshHistory()\\n      }\\n      document.querySelector(\'#create_btn\').addEventListener(\\"click\\", recordHandler);\\n    <\/script>\\n  </body>\\n</html>\\n```\\n\\n#### 4-1. \uc6f9\ud398\uc774\uc9c0\uc5d0 supabase \uc124\uce58\\n\\n- supabase\uc758 \ub3c4\ud050\uba3c\ud2b8 -> [Installing](https://supabase.com/docs/reference/javascript/installing)\uc744 \ubcf4\uba74 \'package\' \ub610\ub294 \'CDN\'\uc744 \ud1b5\ud55c \uc124\uce58 \uc548\ub0b4\uac00 \ub098\uc640\uc788\ub2e4.\\n- \uc5ec\uae30\uc11c\ub294 CDN\uc73c\ub85c supabase\ub97c \uc124\uce58\ud55c\ub2e4.\\n\\n```html\\n<script src=\\"https://cdn.jsdelivr.net/npm/@supabase/supabase-js@2\\"><\/script>\\n//or\\n<script src=\\"https://unpkg.com/@supabase/supabase-js@2\\"><\/script>\\n```\\n\\n#### 4-2. supabase API \uc5f0\uacb0\ud558\uae30\\n\\n![](https://i.imgur.com/IkZn2Rd.png)\\n\\n- \'API \ubb38\uc11c\' \ud0ed\uc744 \ub4e4\uc5b4\uac00\uba74, \'Introduction\' \uc601\uc5ed\uc5d0\uc11c \uc6b0\ub9ac\uac00 API\ub97c \uc5f0\uacb0\ud560 \uc218 \uc788\ub294 \ucf54\ub4dc\uac00 \uc81c\uacf5\ub41c\ub2e4.\\n- \uc6f9\ud398\uc774\uc9c0\uc5d0\uc11c \ud328\ud0a4\uc9c0\ub97c import\ud558\ub294 \uac83\uc774 \uae4c\ub2e4\ub86d\uae30 \ub54c\ubb38\uc5d0, \uc5ec\uae30\uc11c\ub294 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\ub294\ub2e4.\\n  - \ub300\uc2e0\uc5d0 CDN\uc73c\ub85c \uc124\uce58\ud558\uba74 \uc804\uc5ed\ubcc0\uc218 supabase\ub97c \ud1b5\ud574 \uae30\ub2a5\uc744 \uc811\uadfc\ud560 \uc218 \uc788\ub2e4.\\n- \'url\'\uacfc \'key\'\uac00 \uc785\ub825\ub418\uc5b4\uc57c \ud55c\ub2e4.\\n\\n![](https://i.imgur.com/HiRJ0JG.png)\\n\\n- \uc774\ub294 \'\uc124\uc815 -> API\'\uc5d0 \ub4e4\uc5b4\uac00\uba74 \ubcfc \uc218 \uc788\ub2e4.\\n\\n#### 4-3. \ud14c\uc774\ube14\uc5d0\uc11c \ub370\uc774\ud130\ub97c \uc77d\uc5b4\uc624\uae30\\n\\n![](https://i.imgur.com/Vf3G1ne.png)\\n\\n- \'Introduction\' \ud56d\ubaa9 \ubc11\uc5d0 \uc6b0\ub9ac\uac00 \ub9cc\ub4e0 \ud14c\uc774\ube14 \uc774\ub984\uc744 \uace0\ub97c \uc218 \uc788\ub2e4.\\n- \ubc11\uc73c\ub85c \uc2a4\ud06c\ub864\uc744 \uc880 \ub0b4\ub9ac\uba74 \'Read rows\' \uc601\uc5ed\uc5d0 \'READ ALL ROWS\'\uc758 \ucf54\ub4dc\uac00 \uc788\ub2e4.\\n- \uc774 \ube44\ub3d9\uae30(await) \ucf54\ub4dc\ub97c async \ud568\uc218\uc5d0 \ub123\uc5b4\uc11c \uc0ac\uc6a9\ud574\uc8fc\uba74 \ub370\uc774\ud130\ub97c \ubd88\ub7ec\uc640 \ucf58\uc194\uc5d0 \ucd9c\ub825\uc2dc\ucf1c\ubcfc \uc218 \uc788\ub2e4.\\n\\n```js\\nasync function refreshHistory() {\\n    let { data: record, error } = await client.from(\'page\').select(\'*\');\\n    console.log(\'record\', record);\\n```\\n\\n#### 4-4. \uc6f9\ud398\uc774\uc9c0 div \ud0dc\uadf8\uc5d0 \ubd88\ub7ec\uc628 \ub370\uc774\ud130 \uc0bd\uc785\ud558\uae30\\n\\n- \ub370\uc774\ud130\ub97c \uc77d\uc740 \uc218 \ub9cc\ud07c \ud560\ub2f9\ud558\ub294 \ub3d9\uc801\ud560\ub2f9\uc744 \uc704\ud574\uc11c for\ubb38\uc744 \uc0ac\uc6a9\ud55c\ub2e4.\\n  - for\ubb38\uc73c\ub85c record\ub97c \ubc18\ubcf5\ud574\uc11c title\uacfc body\ub97c \ubb38\uc790\uc5f4 tag\uc5d0 \ub2f4\uc544\uc900\ub2e4.\\n  - \uc644\uc131\ub41c tag\ub97c querySelector()\ub97c \ud1b5\ud574\uc11c div\ub97c \uc120\ud0dd\ud5ac\uc11c, innerHTML\uc5d0 \ub123\uc5b4\uc900\ub2e4.\\n\\n```js\\nlet tag = \\"\\";\\nfor (let i = 0; i < record.length; i++) {\\n  tag += `<h2>${record[i].title}</h2>${record[i].body}`;\\n}\\ndocument.querySelector(\\"#history\\").innerHTML = tag;\\n```\\n\\n#### 4-5 \uc6f9\ud398\uc774\uc9c0\uc5d0 \'create\' \ubc84\ud2bc\uc73c\ub85c \ub370\uc774\ud130\ubca0\uc774\uc2a4\uc5d0 \ub370\uc774\ud130 \ucd94\uac00\ud558\uae30\\n\\n- \uc544\uae4c \uc77d\uc5b4\uc628 \uac83\ucc98\ub7fc \'API \ubb38\uc11c\'\uc758 \ud14c\uc774\ube14\uc5d0 \ub4e4\uc5b4\uac00\uc11c \'INSERT A ROW\'\uc758 \ucf54\ub4dc\ub97c \uac00\uc838\uc628\ub2e4.\\n  ![](https://i.imgur.com/O64exzD.png)\\n- \uc704 \ucf54\ub4dc\ub97c \uac00\uc838\uc640\uc11c async \ud568\uc218\uc5d0 \ub123\uc5b4\uc900\ub2e4.\\n- \uc704\uc5d0\uc11c some_column\uacfc other_column\uc5d0 \uc6b0\ub9ac\uac00 \ub123\uace0\uc790 \ud558\ub294 \ub370\uc774\ud130\ubca0\uc774\uc2a4\uc758 \uceec\ub7fc \uac12\uc744 \ub123\uc5b4\uc900\ub2e4.\\n- \uadf8\ub9ac\uace0 \'someValue\'\uc640 \'otherValue\'\uc5d0 \ub123\uace0\uc790 \ud558\ub294 \uac12\uc744 \ub123\uc5b4\uc900\ub2e4.\\n  - \uc5ec\uae30\uc11c\ub294 prompt\ub97c \uc785\ub825\ubc1b\uc544\uc11c \ub370\uc774\ud130\ub97c \uc0bd\uc785\ud574\uc8fc\uace0 \ud398\uc774\uc9c0\uc5d0 \ub79c\ub354\ub9c1\ud55c\ub2e4.\\n\\n```js\\nasync function recordHandler() {\\n  const { data, error } = await client\\n    .from(\\"page\\")\\n    .insert([{ title: prompt(\\"title?\\"), body: prompt(\\"body?\\") }])\\n    .select();\\n  refreshHistory();\\n}\\ndocument.querySelector(\\"#create_btn\\").addEventListener(\\"click\\", recordHandler);\\n```\\n\\n- \uc5ec\uae30\uae4c\uc9c0 supabase \uc785\ubb38\uc5d0 \ub300\ud574 \uc54c\uc544\ubcf4\ub294 \uac83\uc744 \ub9c8\uce5c\ub2e4.\\n\\n### \uacb0\ub860\\n\\n- supabase\ub97c \uac00\uc785\\n- \ud504\ub85c\uc81d\ud2b8\ub97c \ub9cc\ub4e4\uace0\\n- table\uc744 \ub9cc\ub4e4\uc5b4 \uc6f9\ud398\uc774\uc9c0\uc5d0\uc11c \ubd88\ub7ec\uc640(SELECT) \ub79c\ub354\ub9c1\\n- \uc6f9\ud398\uc774\uc9c0\uc5d0\uc11c table\uc758 \ub370\uc774\ud130\ub97c \uc0bd\uc785(INSERT)"},{"id":"features_collection","metadata":{"permalink":"/blog/features_collection","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2023-08-20-features_collection/2023-08-20-features_collection.md","source":"@site/blog/2023-08-20-features_collection/2023-08-20-features_collection.md","title":"\ud3f4\ub9ac\uc6c0\uc758 key_on \ud30c\ub77c\ubbf8\ud130\uc640 GeoJson \ubc0f GeoData \uc774\ud574\ud558\uae30","description":"\ud3f4\ub9ac\uc6c0\uc73c\ub85c \ub4f1\ucc28\uc9c0\uc5ed\ub3c4 \uadf8\ub9ac\uae30","date":"2023-08-20T00:00:00.000Z","formattedDate":"2023\ub144 8\uc6d4 20\uc77c","tags":[{"label":"folium","permalink":"/blog/tags/folium"},{"label":"Choropleth","permalink":"/blog/tags/choropleth"},{"label":"__geo_interface__","permalink":"/blog/tags/geo-interface"},{"label":"GeoJSON","permalink":"/blog/tags/geo-json"},{"label":"key_on","permalink":"/blog/tags/key-on"},{"label":"data","permalink":"/blog/tags/data"}],"readingTime":3.005,"hasTruncateMarker":false,"authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"frontMatter":{"slug":"features_collection","title":"\ud3f4\ub9ac\uc6c0\uc758 key_on \ud30c\ub77c\ubbf8\ud130\uc640 GeoJson \ubc0f GeoData \uc774\ud574\ud558\uae30","authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"tags":["folium","Choropleth","__geo_interface__","GeoJSON","key_on","data"]},"unlisted":false,"prevItem":{"title":"Supabase\ub780 \ubb34\uc5c7\uc778\uac00? \uc6f9\ud398\uc774\uc9c0 SELECT, INSERT \uc2e4\uc2b5","permalink":"/blog/supabase_tutorial_practice"},"nextItem":{"title":"\ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud55c \ub370\uc774\ud130\uc14b \ubd84\ub9ac","permalink":"/blog/bean-scope"}},"content":"## \ud3f4\ub9ac\uc6c0\uc73c\ub85c \ub4f1\ucc28\uc9c0\uc5ed\ub3c4 \uadf8\ub9ac\uae30\\nfolium.Choropleth() \uba54\uc11c\ub4dc\ub97c \uc774\uc6a9\ud574\uc11c \ub4f1\ucc28\uc9c0\uc5ed\ub3c4\ub97c \uadf8\ub9b4 \uc218 \uc788\ub2e4.\\n[\uc11c\uc6b8\uc2dc \uac1c\ubcc4\uacf5\uc2dc\uc9c0\uac00 \uc815\ubcf4](http://data.seoul.go.kr/dataList/OA-1180/F/1/datasetView.do)\uc758 \ub370\uc774\ud130\ub97c \ud65c\uc6a9\ud558\uba74, \ub3d9\ubcc4 \ud3c9\uade0 \uacf5\uc2dc\uc9c0\uac00\ub97c \uad6c\ud560 \uc218 \uc788\uace0,\\n\uc9c0\uc815\ub41c \ub370\uc774\ud130\uc758 \ubc95\uc815\ub3d9 \uc774\ub984\uacfc \uacf5\uc2dc\uc9c0\uac00\uc758 \uceec\ub7fc\uc744 \uac00\uc9c0\uace0 \ub370\uc774\ud130 \ub9cc\ub4e4\uace0, \ubc95\uc815\ub3d9 \uba85\uc744 \ud0a4\ub85c \ud574\uc11c \uc9c0\ub3c4\uc5d0 \uc2dc\uac01\ud654 \uc2dc\ud0a4\uace0\uc790 \ud55c\ub2e4.\\n\\n![](./1_folium_choropleth.png)\\n\\nkey_on\uc758 \ud30c\ub77c\ubbf8\ud130\uc758 \uc778\uc218\ub85c\uc11c geo_data\uc758 \uceec\ub7fc\uc744 \uc9c0\uc815\ud558\ub294 \uc9c0 \uc54a\uace0, JSON\uc758 \ud615\uc2dd\ucc98\ub7fc \\"feature.propertiees.bj_nm\\"\uc744 \ub123\uc5b4\uc8fc\uc5c8\ub2e4.\\n\\ngeo_data\ub294 \uc5b4\ub5bb\uac8c \uc0dd\uacbc\uae38\ub798 \uc774\ub807\uac8c \ub123\uc5b4\uc8fc\ub294 \uac83\uc778\uac00?\\n\\n## Geo_data\ub294 \uc5b4\ub5a4 \ub140\uc11d\uc778\uac00?\\n\\n\uc5ec\uae30\uc5d0\uc11c \ub098\uc624\ub294 sungdong_gu_dong_gpd\ub294 GeoDataFrame\uc774\ub2e4.\\n\\n```python\\nsungdong_gu_dong_gpd.info()\\n```\\n\ub97c \ucd9c\ub825\ud574\ubcf4\uc790. GeoDataFrame\uc774\ub77c\uace0 \ud55c\ub2e4. \uceec\ub7fc\ub4e4\uc744 \uac16\ub294\uac8c \ub370\uc774\ud130\ud504\ub808\uc784\uacfc \ube44\uc2b7\ud574\ubcf4\uc778\ub2e4.\\n\\n![](./2_sungdong_gu_dong_gpd.png)\\n\\n```python\\nsungdong_gu_dong_gpd.head()\\n```\\n\ub97c \ucd9c\ub825\ud574\ubcf4\uc790. \uc5ec\uc804\ud788 \ub370\uc774\ud130 \ud504\ub808\uc784\uacfc \uac19\uc544 \ubcf4\uc778\ub2e4.\\n\\n![](./3_sungdong_gu_dong_gpd.png)\\n\\n```python\\nsungdong_gu_dong_gpd.to_json()\\n```\\n\uc73c\ub85c JSON \ud615\uc2dd\uc73c\ub85c \ubc14\uafd4\ubcf4\uc790.\\n\\n![](./4_sungdong_gu_dong_gpd.png)\\n\ud55c \uc904\ub85c \ub098\uc640\uc11c \ubcf4\uae30\uac00 \ubd88\ud3b8\ud558\ub2e4.\\n\\n```python\\nsungdong_gu_dong_gpd.__geo_interface__\\n```\\n\uc73c\ub85c \ucd9c\ub825\ud558\ub2c8 \ubcf4\uae30\uac00 \uc88b\ub2e4.\\n\\n![](./5_sungdong_gu_dong_gpd.png)\\n\\n\uc6b0\ub9ac\uac00 \ucc3e\ub294 \uad6c\uc870\uc758 json\ud615\uc2dd\uc758 \ud30c\uc77c\uc774 \ub098\uc628\ub2e4. \uadf8\ub7fc JSON \uc790\ub8cc\ud615\uc778\uac00? `__geo_interface__` \uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uc790.\\n\\n## `__geo_interface__`\uc774\ub780 \ubb34\uc5c7\uc778\uac00?\\n`GeoDataFrame.__geo_interface__` \uba54\uc11c\ub4dc\ub294 GeoDataFrame\uc744 \ud30c\uc774\uc36c\uc758 GeoJSON \uac19\uc740 FeaturesCollection\uc758 \ud615\uc2dd\uc73c\ub85c \ubc18\ud658\ud55c\ub2e4.\\n\\n## folium.choropleth(key_on) \ud30c\ub77c\ubbf8\ud130\ub294 \ubb34\uc5c7\uc778\uac00?\\n`folium.Choropleth()`\ub294 \uceec\ub7ec \uadf8\ub808\ub514\uc5b8\ud2b8\ub97c \uc0ac\uc6a9\ud574\uc11c \ub9f5\uc5d0 \ub370\uc774\ud130\ub97c \uc2dc\uac01\ud654 \ud558\uae30 \uc704\ud574 \uc0ac\uc6a9\ud558\ub294 \uba54\uc11c\ub4dc\uc774\ub2e4.\\n\uba54\uc11c\ub4dc\uc758 \ud55c \ud30c\ub77c\ubbf8\ud130\uac00 `key_on`\uc774\ub2e4. \uc774 \ud30c\ub77c\ubbf8\ud130\ub294 \ub2e4\ub978 \ud30c\ub77c\ubbf8\ud130\ub85c \uc81c\uacf5\ub41c `data`\uc640 \ub9e4\uce6d\ub418\uc5b4 \uc0ac\uc6a9\ub418\uc5b4\uc9c8 GeoJSON \ub370\uc774\ud130\uc758 property\ub97c \uac00\ub9ac\ud0a8\ub2e4.\\n\\n\uc704 \ucf54\ub4dc\uc5d0\uc11c \uc0ac\uc6a9\ud55c `key_on=feature.properties.bj_nm`\uc744 \ucabc\uac1c\uc11c \uc774\ud574\ud574\ubcf4\uba74\\n- feature : folium\uc774 GeoJSON\uc744 \uad6c\uc131\ud558\uace0 \uc788\ub294 feature \ub808\ubca8 \ub370\uc774\ud130\uc5d0 \uc811\uadfc\ud558\ub3c4\ub85d \ub9d0\ud574\uc900\ub2e4.\\n- properties : feature\uc640 \ud568\uaed8 \ub9ce\uc774 \uc4f0\uac8c \ub418\ub294 `properties`\ub294 GeoJSON Feature\ub4e4\ub85c \ubb36\uc5ec \uc800\uc7a5\ub41c \ub370\uc774\ud130\ub4e4\uc744 \ub9d0\ud558\uba70 `<GeoJSON_object>`\uc758 \ud558\ub098\uc774\ub2e4.\\n- bj_nm : `properties`\ub85c \ubb36\uc5ec\uc9c4 \ud2b9\uc815 \uc18d\uc131\uc758 \uc774\ub984\uc774\ub2e4.\\n\\n\\n## \uc694\uc57d\\n- foilum.choropleth()\ub294 geoData\uc640 DataFrame\uc744 \uc5f0\uacb0\ud558\uc5ec \uc2dc\uac01\ud654 \ud55c\ub2e4.\\n- \uc774\ub54c, DataFrame\uc740 \uceec\ub7fc, GeoData\ub294 GeoJSON\uc758 property\ub4e4\uc744 \ub9e4\uce6d\ud558\uc5ec \uc2dc\uac01\ud654 \ud55c\ub2e4."},{"id":"bean-scope","metadata":{"permalink":"/blog/bean-scope","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2023-04-23-bean-scope/2023-04-23-bean-scope.md","source":"@site/blog/2023-04-23-bean-scope/2023-04-23-bean-scope.md","title":"\ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud55c \ub370\uc774\ud130\uc14b \ubd84\ub9ac","description":"- \ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud574\uc11c \ub370\uc774\ud130\uc14b\uc744 \ubd84\ub9ac\ud558\ub294 \uc808\ucc28\uc5d0 \ub300\ud574 \uc54c\uc544\ubcf4\uc790.","date":"2023-04-23T00:00:00.000Z","formattedDate":"2023\ub144 4\uc6d4 23\uc77c","tags":[{"label":"ai","permalink":"/blog/tags/ai"},{"label":"pytorch","permalink":"/blog/tags/pytorch"},{"label":"dataset","permalink":"/blog/tags/dataset"},{"label":"sklearn","permalink":"/blog/tags/sklearn"}],"readingTime":5.375,"hasTruncateMarker":false,"authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"frontMatter":{"slug":"bean-scope","title":"\ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud55c \ub370\uc774\ud130\uc14b \ubd84\ub9ac","authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"tags":["ai","pytorch","dataset","sklearn"]},"unlisted":false,"prevItem":{"title":"\ud3f4\ub9ac\uc6c0\uc758 key_on \ud30c\ub77c\ubbf8\ud130\uc640 GeoJson \ubc0f GeoData \uc774\ud574\ud558\uae30","permalink":"/blog/features_collection"},"nextItem":{"title":"\ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud55c \ub370\uc774\ud130\uc14b \ubd84\ub9ac","permalink":"/blog/pytorch-dataset-split"}},"content":"- \ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud574\uc11c \ub370\uc774\ud130\uc14b\uc744 \ubd84\ub9ac\ud558\ub294 \uc808\ucc28\uc5d0 \ub300\ud574 \uc54c\uc544\ubcf4\uc790.\\n- \ubd84\ub9ac\ud558\ub294 \uacfc\uc815\uc5d0\uc11c \uc0ac\uc6a9\ub418\ub294 \ud568\uc218\ub4e4\uc5d0 \ub300\ud574 \uc815\ub9ac\ud558\uc790.\\n\\n\\n# \uc65c \ud30c\uc774\ud1a0\uce58\uc778\uac00?\\n- \ud30c\uc774\ud1a0\uce58\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \ud1a0\uce58\ub294 \uc2e0\uacbd\ub9dd\uc744 \uad6c\uc131\ud558\uace0 \ud6c8\ub828\ud558\ub294 \ud575\uc2ec \uae30\ub2a5\uc744 \uc81c\uacf5\ud558\ub294 \ud328\ud0a4\uc9c0\ub2e4.\\n- \ub2e4\ucc28\uc6d0 \ubc30\uc5f4\uc774\ub77c \ubd88\ub9ac\ub294 \ud150\uc11c\ub97c \uc0ac\uc6a9\ud55c\ub2e4. \ub118\ud30c\uc774\ubc30\uc5f4\ub3c4 \ub2e4\ucc28\uc6d0\uc744 \uc9c0\uc6d0\ud55c\ub2e4.\\n- \ud558\uc9c0\ub9cc, \ud150\uc11c\ub294 GPU\uac00\uc18d \uc9c0\uc6d0\uacfc \ud150\uc11c\uc758 \uadf8\ub77c\ub514\uc5b8\ud2b8\ub97c \uc790\ub3d9\uc73c\ub85c \uad6c\ud574\uc8fc\ub294 \'autograd\'\ub97c \uc9c0\uc6d0\ud55c\ub2e4.\\n- \uc774\ub85c\uc368, \uac1c\ubc1c\uc790\uac00 \ubcf5\uc7a1\ud55c \uc5f0\uc0b0 \uadf8\ub798\ud504\ub97c \uc815\uc758\ud558\ub3c4\ub85d \ud574\uc8fc\uace0 \ud6c8\ub828 \uc911\uc5d0 \uc5ed\uc804\ud30c\uc5d0 \ub300\ud55c \uadf8\ub808\ub514\uc5b8\ud2b8\ub97c \uc790\ub3d9\uc73c\ub85c \uc5f0\uc0b0\ud574\uc900\ub2e4.\\n\\n# \ub370\uc774\ud130\uc14b\uc758 \ubd84\ub9ac\\n- \ub370\uc774\ud130\uc14b\uc740 \ubaa8\ub378\uc758 \ud559\uc2b5, \uac80\uc99d, \ud3c9\uac00\uc5d0 \ub530\ub77c \uad6c\ubd84\ud558\uc5ec \uc0ac\uc6a9\ud55c\ub2e4.\\n- \ud559\uc2b5\ub370\uc774\ud130\uc14b\uc740 \ubaa8\ub378\uc5d0 \ud30c\ub77c\ubbf8\ud130\ub97c \ud559\uc2b5\ud558\ub294\ub370 \uc0ac\uc6a9\ud558\uace0\\n- \uac80\uc99d\ub370\uc774\ud130\uc14b\uc740 \ud559\uc2b5\ud558\ub294\ub370 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\uc9c0\ub9cc, \uac80\uc99d\ub370\uc774\ud130\ub97c \uc88b\uac8c \ub9cc\ub4e4\uae30 \uc704\ud574 \ud558\uc774\ud37c\ud30c\ub77c\ubbf8\ud130\ub97c \ud29c\ub2dd\ud558\uac70\ub098 \ud559\uc2b5\ub370\uc774\ud130\ub97c \uc804\ucc98\ub9ac\ud55c\ub2e4.\\n- \ud3c9\uac00\ub370\uc774\ud130\uc14b\uc740 \ub2e4\uc591\ud55c \ubaa8\ub378\uc758 \uc131\ub2a5\uc744 \ube44\uad50\ud558\uae30 \uc704\ud574 \uc0ac\uc6a9\ud558\ub294 \uc6a9\ub3c4\ub85c \uad6c\ubd84\ud55c\ub2e4.\\n\\n# \ub370\uc774\ud130\ud504\ub808\uc784\uc758 \ubd84\ub9ac\\n## sklearn \ub370\uc774\ud130\uc14b \ubd88\ub7ec\uc624\uae30\\n```python\\nfrom sklearn.datasets import fetch_california_housing\\n\\ncalifonia = fetch_california_housing()\\n```\\n- sklearn.datasets\uc5d0\uc11c fetch_califonia_housing\uc744 \uc784\ud3ec\ud2b8\ud574\uc11c califonia\uc5d0 \ub123\uc5b4\uc900\ub2e4.\\n```python\\ndf = pd.DataFrame(califonia.data, columns = califonia.feature_names)\\n```\\n- \uc784\ud3ec\ud2b8\ud55c califonia.values\ub97c pandas.DataFrame()\uc778 df\uc5d0 \ub123\uc5b4\uc900\ub2e4.\\n- sklearn\uc5d0\uc11c \uc784\ud3ec\ud2b8\ud55c califonia\ub294 data, target, feature_names, DESCR, frame \ub4f1\uc758 \ub370\uc774\ud130\uc14b\uc778 Bunch\ub97c \uac00\uc9c0\uace0 \uc788\ub2e4. \ud638\ucd9c \ud558\ub294 \ubc29\ubc95\uc740 \uac1d\uccb4.(\uc694\uccad\ud558\ub294 bunch)\ub97c \ud1b5\ud574 \ud638\ucd9c\ud55c\ub2e4.\\n- .data\ub294 ndarray\ud0c0\uc785\uc73c\ub85c, shpae = (20640, 8)\uc774\ub2e4.\\n- .feature_names\uc740 \uae38\uc774\uac00 8\uc778 \ub9ac\uc2a4\ud2b8\uc774\ub2e4.\\n```python\\ndf[\\"Target\\"] = califonia.target\\n```\\n- .target\uc740 numpy array \ud0c0\uc785\uc73c\ub85c, shape = (20640,)\\n- \ub9cc\ub4e4\uc5b4\uc9c4 df\uc5d0 \\"Target\\" \uceec\ub7fc\uc744 \ucd94\uac00\ud558\uace0, califonia.target\uc758 \uc5b4\ub808\uc774\ub97c \ub123\uc5b4\uc900\ub2e4.\\n```python\\ndf.tail()\\n```\\n- \ub370\uc774\ud130\ud504\ub808\uc784\uc758 \ud558\uc704 5\uac1c\uc758 \ub370\uc774\ud130\ub97c \ub4dc\ub824\ub2e4\ubcf4\uba74 \uc544\ub798\uc640 \uac19\ub2e4.\\n![](../2023-04-03-pytorch-dataset-split/sklearn-california-housing.png)\\n\\n## \ud30c\uc774\ud1a0\uce58\uc758 \ud150\uc11c \ubd84\ub9ac\ud558\uae30\\n### float \uc790\ub8cc\ud615\uc758 \ud150\uc11c \ud638\ucd9c\\n```python\\nimport torch\\n\\ndata = torch.from_numpy(df.values).float()\\n```\\n- \ud30c\uc774\ud1a0\uce58\ub97c \uc784\ud3ec\ud2b8\ud558\uace0\\n- df.values\ub85c \ub370\uc774\ud130\ud504\ub808\uc784\uc758 \uac12\uc744 \ub118\ud30c\uc774\ubc30\uc5f4\ub85c \ud638\ucd9c\ud55c\ub2e4.\\n- \ud638\ucd9c\ub41c \ubc30\uc5f4\uc744 from_numpy()\ub97c \ud1b5\ud574 \ud150\uc11c\ub97c \ubc18\ud658\ud558\uace0\\n- .float()\uc744 \ud1b5\ud574\uc11c \uc790\ub8cc\ud615\uc744 \uc120\uc5b8\ud55c\ub2e4.\\n\\n### \uc785\ub825\uacfc \ucd9c\ub825\uc744 \ub098\ub208\ub2e4.\\n- \ud150\uc11c\uc758 \ub370\uc774\ud130\uc14b\uc744 \uc785\ub825\uac12\uacfc \ucd9c\ub825\uac12(\ub808\uc774\ube14)\uc73c\ub85c \ubd84\ub9ac\ud55c\ub2e4.\\n```python\\nx = data[:,:-1]\\ny = data[:, -1:]\\n```\\n- \ub098\ub204\uace0 \uc0ac\uc774\uc988\ub97c \ucd9c\ub825\ud574\ubcf4\uc790.\\n- x.size() = torch.Size[20640,8]\\n- y.size() = torch.Size[20640,1]\\n\\n### \ud6c8\ub828 / \uac80\uc99d / \ud3c9\uac00 \ub370\uc774\ud130\uc14b \ube44\uc728 \uc815\ud558\uae30\\n- 6:2:2\ub85c \ud558\ub294\uac8c \ubb34\ub09c\ud558\uc9c0\ub9cc, \ub370\uc774\ud130\uc14b\uc774 \ud074\uc218\ub85d, \ube44\uc728\uc740 \ud06c\uac8c \uc0c1\uad00 \uc5c6\ub2e4.\\n```python\\nratios = [.6, .2, .2]\\n```\\n\\n### \ube44\uc728\uc5d0 \ub530\ub978 \ub370\uc774\ud130\uc14b\uc758 \ud06c\uae30\ub97c \uc815\ud558\uae30\\n- \ube44\uc728\uc5d0 \ub530\ub978 \ub370\uc774\ud130\uc14b\uc758 \ud06c\uae30\ub97c train_cnt, valid_cnt, test_cnt\ub85c \uac01\uac01 \uc815\uc758\ud558\uace0 cnts \ubc30\uc5f4\uc5d0 \ub123\uc5b4\uc900\ub2e4.\\n```python\\ntrain_cnt = int(data.size(0) * ratios[0])\\nvaild_cnt = int(data.size(0) * ratios[1])\\ntest_cnt = data.size(0)-train_cnt-valid_cnt\\n\\ncnts = [train_cnt, valid_cnt, test_cnt]\\n```\\n\\n### \ubb34\uc791\uc704\ub85c \ucd94\ucd9c\ud558\uae30 \uc704\ud574 \uc11e\uc5b4\uc11c \ubd84\ub9ac\ud55c\ub2e4.\\n\\n```python\\nindices = torch.randperm(data.size(0))\\n```\\n- torch.randperm(n)\uc740 0\ubd80\ud130 n-1\uae4c\uc9c0 \uc815\uc218\uc758 \ub79c\ub364 \uc218\uc5f4\uc744 \ubc18\ud658\ud55c\ub2e4.\\n- data.size(0)\ub294 \ud150\uc11c\uc758 0\ucc28\uc6d0\uc758 \ud06c\uae30\uc778 20640\uc744 \ubc18\ud658\ud55c\ub2e4.\\n- \uc989, indices \ubcc0\uc218\ub294 0\ubd80\ud130 20639\uae4c\uc9c0\uc758 \uc815\uc218\ub97c \ub79c\ub364 \uc218\uc5f4\ub85c \ubc18\ud658\ud55c\ub2e4.\\n```python\\nx = torch.index_select(x, dim=0, index = indices)\\ny = torch.index_select(y, dim=0, index = indices)\\n```\\n- torch.index_select()\ub97c \ud1b5\ud574\uc11c, \ud150\uc11c x,y\uc758 0\ucc28\uc6d0\uc758 \ubc29\ud5a5\uc73c\ub85c indices\ub97c \uc778\ub371\uc2a4\ub85c \ud558\ub294 \uc0c8\ub85c\uc6b4 \ud150\uc11c\ub97c \ubc18\ud658\ud55c\ub2e4.\\n```python\\nx = list(x.split(cnts, dim=0))\\ny = y.split(cnts, dim=0)\\n```\\n- 0\ucc28\uc6d0\uc744 \ub530\ub77c cnts \ubc30\uc5f4\uc758 split_size\ub97c \uac00\uc9c0\uace0 \ubd84\ub9ac\ud55c\ub2e4.\\n- x\ub97c \ubd84\ub9ac\ud558\uba74 tuple\uc758 \uc790\ub8cc\ud615\uc774\ub77c list()\ub85c \uac10\uc2f8\uc900\ub2e4.\\n\\n```python\\nfor x_i, y_i in zip(x,y):\\n\\tprint(x_i.size(), y_i.size())\\n```\\n- \ub2e4\uc74c\uacfc \uac19\uc774 \uc791\uc131\ud558\uace0 \uc2e4\ud589\ud558\uba74 \ubd84\ub9ac\ub41c \uacb0\uacfc\ub97c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n- torch.Size([12384, 8]). torch.Size([12384, 1])\\n- torch.Size([4128, 8]). torch.Size([4128, 1])\\n- torch.Size([4128, 8]). torch.Size([4128, 1])"},{"id":"pytorch-dataset-split","metadata":{"permalink":"/blog/pytorch-dataset-split","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2023-04-03-pytorch-dataset-split/2023-04-03-\u1111\u1161\u110b\u1175\u1110\u1169\u110e\u1175\u1105\u1173\u11af \u110b\u1175\u110b\u116d\u11bc\u1112\u1161\u11ab \u1103\u1166\u110b\u1175\u1110\u1165\u1109\u1166\u11ba \u1107\u116e\u11ab\u1105\u1175.md","source":"@site/blog/2023-04-03-pytorch-dataset-split/2023-04-03-\u1111\u1161\u110b\u1175\u1110\u1169\u110e\u1175\u1105\u1173\u11af \u110b\u1175\u110b\u116d\u11bc\u1112\u1161\u11ab \u1103\u1166\u110b\u1175\u1110\u1165\u1109\u1166\u11ba \u1107\u116e\u11ab\u1105\u1175.md","title":"\ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud55c \ub370\uc774\ud130\uc14b \ubd84\ub9ac","description":"- \ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud574\uc11c \ub370\uc774\ud130\uc14b\uc744 \ubd84\ub9ac\ud558\ub294 \uc808\ucc28\uc5d0 \ub300\ud574 \uc54c\uc544\ubcf4\uc790.","date":"2023-04-03T00:00:00.000Z","formattedDate":"2023\ub144 4\uc6d4 3\uc77c","tags":[{"label":"ai","permalink":"/blog/tags/ai"},{"label":"pytorch","permalink":"/blog/tags/pytorch"},{"label":"dataset","permalink":"/blog/tags/dataset"},{"label":"sklearn","permalink":"/blog/tags/sklearn"}],"readingTime":5.375,"hasTruncateMarker":false,"authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"frontMatter":{"slug":"pytorch-dataset-split","title":"\ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud55c \ub370\uc774\ud130\uc14b \ubd84\ub9ac","authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"tags":["ai","pytorch","dataset","sklearn"]},"unlisted":false,"prevItem":{"title":"\ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud55c \ub370\uc774\ud130\uc14b \ubd84\ub9ac","permalink":"/blog/bean-scope"},"nextItem":{"title":"\uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uac1c\ubc1c\uc758 \uae30\ucd08 \uc0c1\uc2dd","permalink":"/blog/spring-boot-dev-basic"}},"content":"- \ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud574\uc11c \ub370\uc774\ud130\uc14b\uc744 \ubd84\ub9ac\ud558\ub294 \uc808\ucc28\uc5d0 \ub300\ud574 \uc54c\uc544\ubcf4\uc790.\\n- \ubd84\ub9ac\ud558\ub294 \uacfc\uc815\uc5d0\uc11c \uc0ac\uc6a9\ub418\ub294 \ud568\uc218\ub4e4\uc5d0 \ub300\ud574 \uc815\ub9ac\ud558\uc790.\\n\\n\\n# \uc65c \ud30c\uc774\ud1a0\uce58\uc778\uac00?\\n- \ud30c\uc774\ud1a0\uce58\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \ud1a0\uce58\ub294 \uc2e0\uacbd\ub9dd\uc744 \uad6c\uc131\ud558\uace0 \ud6c8\ub828\ud558\ub294 \ud575\uc2ec \uae30\ub2a5\uc744 \uc81c\uacf5\ud558\ub294 \ud328\ud0a4\uc9c0\ub2e4.\\n- \ub2e4\ucc28\uc6d0 \ubc30\uc5f4\uc774\ub77c \ubd88\ub9ac\ub294 \ud150\uc11c\ub97c \uc0ac\uc6a9\ud55c\ub2e4. \ub118\ud30c\uc774\ubc30\uc5f4\ub3c4 \ub2e4\ucc28\uc6d0\uc744 \uc9c0\uc6d0\ud55c\ub2e4.\\n- \ud558\uc9c0\ub9cc, \ud150\uc11c\ub294 GPU\uac00\uc18d \uc9c0\uc6d0\uacfc \ud150\uc11c\uc758 \uadf8\ub77c\ub514\uc5b8\ud2b8\ub97c \uc790\ub3d9\uc73c\ub85c \uad6c\ud574\uc8fc\ub294 \'autograd\'\ub97c \uc9c0\uc6d0\ud55c\ub2e4.\\n- \uc774\ub85c\uc368, \uac1c\ubc1c\uc790\uac00 \ubcf5\uc7a1\ud55c \uc5f0\uc0b0 \uadf8\ub798\ud504\ub97c \uc815\uc758\ud558\ub3c4\ub85d \ud574\uc8fc\uace0 \ud6c8\ub828 \uc911\uc5d0 \uc5ed\uc804\ud30c\uc5d0 \ub300\ud55c \uadf8\ub808\ub514\uc5b8\ud2b8\ub97c \uc790\ub3d9\uc73c\ub85c \uc5f0\uc0b0\ud574\uc900\ub2e4.\\n\\n# \ub370\uc774\ud130\uc14b\uc758 \ubd84\ub9ac\\n- \ub370\uc774\ud130\uc14b\uc740 \ubaa8\ub378\uc758 \ud559\uc2b5, \uac80\uc99d, \ud3c9\uac00\uc5d0 \ub530\ub77c \uad6c\ubd84\ud558\uc5ec \uc0ac\uc6a9\ud55c\ub2e4.\\n- \ud559\uc2b5\ub370\uc774\ud130\uc14b\uc740 \ubaa8\ub378\uc5d0 \ud30c\ub77c\ubbf8\ud130\ub97c \ud559\uc2b5\ud558\ub294\ub370 \uc0ac\uc6a9\ud558\uace0\\n- \uac80\uc99d\ub370\uc774\ud130\uc14b\uc740 \ud559\uc2b5\ud558\ub294\ub370 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\uc9c0\ub9cc, \uac80\uc99d\ub370\uc774\ud130\ub97c \uc88b\uac8c \ub9cc\ub4e4\uae30 \uc704\ud574 \ud558\uc774\ud37c\ud30c\ub77c\ubbf8\ud130\ub97c \ud29c\ub2dd\ud558\uac70\ub098 \ud559\uc2b5\ub370\uc774\ud130\ub97c \uc804\ucc98\ub9ac\ud55c\ub2e4.\\n- \ud3c9\uac00\ub370\uc774\ud130\uc14b\uc740 \ub2e4\uc591\ud55c \ubaa8\ub378\uc758 \uc131\ub2a5\uc744 \ube44\uad50\ud558\uae30 \uc704\ud574 \uc0ac\uc6a9\ud558\ub294 \uc6a9\ub3c4\ub85c \uad6c\ubd84\ud55c\ub2e4.\\n\\n# \ub370\uc774\ud130\ud504\ub808\uc784\uc758 \ubd84\ub9ac\\n## sklearn \ub370\uc774\ud130\uc14b \ubd88\ub7ec\uc624\uae30\\n```python\\nfrom sklearn.datasets import fetch_california_housing\\n\\ncalifonia = fetch_california_housing()\\n```\\n- sklearn.datasets\uc5d0\uc11c fetch_califonia_housing\uc744 \uc784\ud3ec\ud2b8\ud574\uc11c califonia\uc5d0 \ub123\uc5b4\uc900\ub2e4.\\n```python\\ndf = pd.DataFrame(califonia.data, columns = califonia.feature_names)\\n```\\n- \uc784\ud3ec\ud2b8\ud55c califonia.values\ub97c pandas.DataFrame()\uc778 df\uc5d0 \ub123\uc5b4\uc900\ub2e4.\\n- sklearn\uc5d0\uc11c \uc784\ud3ec\ud2b8\ud55c califonia\ub294 data, target, feature_names, DESCR, frame \ub4f1\uc758 \ub370\uc774\ud130\uc14b\uc778 Bunch\ub97c \uac00\uc9c0\uace0 \uc788\ub2e4. \ud638\ucd9c \ud558\ub294 \ubc29\ubc95\uc740 \uac1d\uccb4.(\uc694\uccad\ud558\ub294 bunch)\ub97c \ud1b5\ud574 \ud638\ucd9c\ud55c\ub2e4.\\n- .data\ub294 ndarray\ud0c0\uc785\uc73c\ub85c, shpae = (20640, 8)\uc774\ub2e4.\\n- .feature_names\uc740 \uae38\uc774\uac00 8\uc778 \ub9ac\uc2a4\ud2b8\uc774\ub2e4.\\n```python\\ndf[\\"Target\\"] = califonia.target\\n```\\n- .target\uc740 numpy array \ud0c0\uc785\uc73c\ub85c, shape = (20640,)\\n- \ub9cc\ub4e4\uc5b4\uc9c4 df\uc5d0 \\"Target\\" \uceec\ub7fc\uc744 \ucd94\uac00\ud558\uace0, califonia.target\uc758 \uc5b4\ub808\uc774\ub97c \ub123\uc5b4\uc900\ub2e4.\\n```python\\ndf.tail()\\n```\\n- \ub370\uc774\ud130\ud504\ub808\uc784\uc758 \ud558\uc704 5\uac1c\uc758 \ub370\uc774\ud130\ub97c \ub4dc\ub824\ub2e4\ubcf4\uba74 \uc544\ub798\uc640 \uac19\ub2e4.\\n![](sklearn-california-housing.png)\\n\\n## \ud30c\uc774\ud1a0\uce58\uc758 \ud150\uc11c \ubd84\ub9ac\ud558\uae30\\n### float \uc790\ub8cc\ud615\uc758 \ud150\uc11c \ud638\ucd9c\\n```python\\nimport torch\\n\\ndata = torch.from_numpy(df.values).float()\\n```\\n- \ud30c\uc774\ud1a0\uce58\ub97c \uc784\ud3ec\ud2b8\ud558\uace0\\n- df.values\ub85c \ub370\uc774\ud130\ud504\ub808\uc784\uc758 \uac12\uc744 \ub118\ud30c\uc774\ubc30\uc5f4\ub85c \ud638\ucd9c\ud55c\ub2e4.\\n- \ud638\ucd9c\ub41c \ubc30\uc5f4\uc744 from_numpy()\ub97c \ud1b5\ud574 \ud150\uc11c\ub97c \ubc18\ud658\ud558\uace0\\n- .float()\uc744 \ud1b5\ud574\uc11c \uc790\ub8cc\ud615\uc744 \uc120\uc5b8\ud55c\ub2e4.\\n\\n### \uc785\ub825\uacfc \ucd9c\ub825\uc744 \ub098\ub208\ub2e4.\\n- \ud150\uc11c\uc758 \ub370\uc774\ud130\uc14b\uc744 \uc785\ub825\uac12\uacfc \ucd9c\ub825\uac12(\ub808\uc774\ube14)\uc73c\ub85c \ubd84\ub9ac\ud55c\ub2e4.\\n```python\\nx = data[:,:-1]\\ny = data[:, -1:]\\n```\\n- \ub098\ub204\uace0 \uc0ac\uc774\uc988\ub97c \ucd9c\ub825\ud574\ubcf4\uc790.\\n- x.size() = torch.Size[20640,8]\\n- y.size() = torch.Size[20640,1]\\n\\n### \ud6c8\ub828 / \uac80\uc99d / \ud3c9\uac00 \ub370\uc774\ud130\uc14b \ube44\uc728 \uc815\ud558\uae30\\n- 6:2:2\ub85c \ud558\ub294\uac8c \ubb34\ub09c\ud558\uc9c0\ub9cc, \ub370\uc774\ud130\uc14b\uc774 \ud074\uc218\ub85d, \ube44\uc728\uc740 \ud06c\uac8c \uc0c1\uad00 \uc5c6\ub2e4.\\n```python\\nratios = [.6, .2, .2]\\n```\\n\\n### \ube44\uc728\uc5d0 \ub530\ub978 \ub370\uc774\ud130\uc14b\uc758 \ud06c\uae30\ub97c \uc815\ud558\uae30\\n- \ube44\uc728\uc5d0 \ub530\ub978 \ub370\uc774\ud130\uc14b\uc758 \ud06c\uae30\ub97c train_cnt, valid_cnt, test_cnt\ub85c \uac01\uac01 \uc815\uc758\ud558\uace0 cnts \ubc30\uc5f4\uc5d0 \ub123\uc5b4\uc900\ub2e4.\\n```python\\ntrain_cnt = int(data.size(0) * ratios[0])\\nvaild_cnt = int(data.size(0) * ratios[1])\\ntest_cnt = data.size(0)-train_cnt-valid_cnt\\n\\ncnts = [train_cnt, valid_cnt, test_cnt]\\n```\\n\\n### \ubb34\uc791\uc704\ub85c \ucd94\ucd9c\ud558\uae30 \uc704\ud574 \uc11e\uc5b4\uc11c \ubd84\ub9ac\ud55c\ub2e4.\\n\\n```python\\nindices = torch.randperm(data.size(0))\\n```\\n- torch.randperm(n)\uc740 0\ubd80\ud130 n-1\uae4c\uc9c0 \uc815\uc218\uc758 \ub79c\ub364 \uc218\uc5f4\uc744 \ubc18\ud658\ud55c\ub2e4.\\n- data.size(0)\ub294 \ud150\uc11c\uc758 0\ucc28\uc6d0\uc758 \ud06c\uae30\uc778 20640\uc744 \ubc18\ud658\ud55c\ub2e4.\\n- \uc989, indices \ubcc0\uc218\ub294 0\ubd80\ud130 20639\uae4c\uc9c0\uc758 \uc815\uc218\ub97c \ub79c\ub364 \uc218\uc5f4\ub85c \ubc18\ud658\ud55c\ub2e4.\\n```python\\nx = torch.index_select(x, dim=0, index = indices)\\ny = torch.index_select(y, dim=0, index = indices)\\n```\\n- torch.index_select()\ub97c \ud1b5\ud574\uc11c, \ud150\uc11c x,y\uc758 0\ucc28\uc6d0\uc758 \ubc29\ud5a5\uc73c\ub85c indices\ub97c \uc778\ub371\uc2a4\ub85c \ud558\ub294 \uc0c8\ub85c\uc6b4 \ud150\uc11c\ub97c \ubc18\ud658\ud55c\ub2e4.\\n```python\\nx = list(x.split(cnts, dim=0))\\ny = y.split(cnts, dim=0)\\n```\\n- 0\ucc28\uc6d0\uc744 \ub530\ub77c cnts \ubc30\uc5f4\uc758 split_size\ub97c \uac00\uc9c0\uace0 \ubd84\ub9ac\ud55c\ub2e4.\\n- x\ub97c \ubd84\ub9ac\ud558\uba74 tuple\uc758 \uc790\ub8cc\ud615\uc774\ub77c list()\ub85c \uac10\uc2f8\uc900\ub2e4.\\n\\n```python\\nfor x_i, y_i in zip(x,y):\\n\\tprint(x_i.size(), y_i.size())\\n```\\n- \ub2e4\uc74c\uacfc \uac19\uc774 \uc791\uc131\ud558\uace0 \uc2e4\ud589\ud558\uba74 \ubd84\ub9ac\ub41c \uacb0\uacfc\ub97c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n- torch.Size([12384, 8]). torch.Size([12384, 1])\\n- torch.Size([4128, 8]). torch.Size([4128, 1])\\n- torch.Size([4128, 8]). torch.Size([4128, 1])"},{"id":"spring-boot-dev-basic","metadata":{"permalink":"/blog/spring-boot-dev-basic","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2023-03-25-Spring-boot-dev-basic/2023-03-25-Spring-boot-dev-basic.md","source":"@site/blog/2023-03-25-Spring-boot-dev-basic/2023-03-25-Spring-boot-dev-basic.md","title":"\uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uac1c\ubc1c\uc758 \uae30\ucd08 \uc0c1\uc2dd","description":"- \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc774 \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uc9c0","date":"2023-03-25T00:00:00.000Z","formattedDate":"2023\ub144 3\uc6d4 25\uc77c","tags":[{"label":"data","permalink":"/blog/tags/data"},{"label":"spring-boot","permalink":"/blog/tags/spring-boot"},{"label":"contoller","permalink":"/blog/tags/contoller"},{"label":"handler-mapping","permalink":"/blog/tags/handler-mapping"}],"readingTime":11.375,"hasTruncateMarker":false,"authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"frontMatter":{"slug":"spring-boot-dev-basic","title":"\uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uac1c\ubc1c\uc758 \uae30\ucd08 \uc0c1\uc2dd","authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"tags":["data","spring-boot","contoller","handler-mapping"]},"unlisted":false,"prevItem":{"title":"\ud30c\uc774\ud1a0\uce58\ub97c \uc774\uc6a9\ud55c \ub370\uc774\ud130\uc14b \ubd84\ub9ac","permalink":"/blog/pytorch-dataset-split"},"nextItem":{"title":"\ub118\ud30c\uc774\uc640 \uce5c\ud574\uc9c4 \ud310\ub2e4\uc2a4 2.0","permalink":"/blog/pandas-2-feature-1"}},"content":"- \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc774 \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uc9c0\\n- \uc5b4\ub5a0\ud55c \uc774\uc720\ub85c \uc774\ub7ec\ud55c \uad6c\uc131\uc744 \uac16\uac8c \ub418\ub294\uc9c0\\n- \uc704\uc5d0 \uad00\ud55c \uc810\ub4e4\uc744 \uc54c\uace0 \uc2e4\uc2b5\ud558\uae30 \uc704\ud55c \uae30\ucd08\uc9c0\uc2dd\\n\\n# \uc11c\ubc84 \uac04 \ud1b5\uc2e0\\n- \uc11c\ubc84 \uac04 \ud1b5\uc2e0\uc740 \ud55c \uc11c\ubc84\uc5d0\uc11c \ub2e4\ub978 \uc11c\ubc84\ub85c \uc694\uccad\ud558\ub294 \uac83\uc744 \uc758\ubbf8\ud558\ub294 \ub2e8\uc5b4\ub85c\\n- \ud1b5\uc2e0\uc744 \uc694\uccad\ud558\ub294 \ud074\ub77c\uc774\uc5b8\ud2b8\uc640 \uc751\ub2f5\uc744 \ub0b4\ub824\uc8fc\ub294 \uc11c\ubc84 \uac04\uc758 \ud1b5\uc2e0\uc744 \uc774\uc57c\uae30\ud55c\ub2e4.\\n- \uac00\uc7a5 \ud754\ud55c \ud504\ub85c\ud1a0\ucf5c\uc774 HTTP/HTTPS \ubc29\uc2dd\uc774\ub2e4.\\n\\n## \ub9c8\uc774\ud06c\ub85c\uc11c\ube44\uc2a4 \uc544\ud0a4\ud14d\ucc98\uc5d0\uc11c \ub354 \ub9ce\uc774 \ud65c\uc6a9\ub41c\ub2e4.\\n- \ub2e8\uc77c \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc73c\ub85c \ub2e4\uc591\ud55c \uc11c\ube44\uc2a4\ub97c \ud558\uba74 \uc720\uc9c0\ubcf4\uc218\uc5d0 \ub530\ub978 \ube44\uc6a9\uc774 \ud06c\ub2e4.\\n- \ub530\ub77c\uc11c, \uc694\uc998\uc5d0\ub294 \uc5ec\ub7ec \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \uc11c\ube44\uc2a4\ubcc4\ub85c \ub098\ub220\uc11c \uac1c\ubc1c\ud55c\ub2e4.\\n- \ud558\uc9c0\ub9cc \uc774\ub54c\ubb38\uc5d0 \uac01\uc790\uc758 \ub3c5\ub9bd\uc801\uc778 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \uc11c\ubc84\uac04\uc758 \ud1b5\uc2e0\uc774 \uc7a6\uc544\uc9c4\ub2e4.\\n\\n# \uc2a4\ud504\ub9c1 \ubd80\ud2b8 \ub3d9\uc791 \ubc29\uc2dd\\n- \uc2a4\ud504\ub9c1 \ubd80\ud2b8\uc5d0\uc11c\ub294 \uae30\ubcf8\uc801\uc73c\ub85c \ud1b0\ucea3\uc744 \uc0ac\uc6a9\ud558\ub294 \uc2a4\ud504\ub9c1 MVC \uad6c\uc870\ub97c \uae30\ubc18\uc73c\ub85c \ub3d9\uc791\ud55c\ub2e4.\\n![](../2023-03-23-spring-boot/dispatching-servlet.png)\\n## \uc11c\ube14\ub9bf\\n- \uc11c\ube14\ub9bf\uc740 \ud074\ub77c\uc774\uc5b8\ud2b8\uc758 \uc694\uccad\uc744 \ucc98\ub9ac\ud558\uace0 \uacb0\uacfc\ub97c \ubc18\ud658\ud558\ub294 \uc6f9\ud504\ub85c\uadf8\ub798\ubc0d \uae30\uc220\uc774\ub2e4.\\n- \uc11c\ube14\ub9bf \ucee8\ud14c\uc774\ub108\uac00 \uc11c\ube14\ub9bf \uc778\uc2a4\ud134\uc2a4\ub97c \uc0dd\uc131\ud558\uace0 \uad00\ub9ac\ud55c\ub2e4.\\n\\n## \uc2a4\ud504\ub9c1\uc5d0\uc11c \uc11c\ube14\ub9bf\\n- \uc2a4\ud504\ub9c1\uc5d0\uc11c\ub294 \ubc1c\uc1a1 \uc11c\ube14\ub81b\uc774 \uc6f9 \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc73c\ub85c \ub4e4\uc5b4\uc624\ub294 \ubaa8\ub4e0 \uc694\uccad\uc744 \uc911\uc559\uc81c\uc5b4\ud558\ub294 \ud504\ub860\ud2b8 \ucee8\ud2b8\ub864\ub7ec\ub97c \uad6c\ud604\ud55c\ub2e4.\\n- \ubc1c\uc1a1 \uc11c\ube14\ub9bf\uc774 \ub4e4\uc5b4\uc624\ub294 \uc694\uccad\uc744 \ubc1b\uc544\uc11c \uc801\uc808\ud55c \ud578\ub4e4\ub7ec\uc5d0 \uc804\ub2ec\ud55c\ub2e4.\\n- \ubc1c\uc1a1 \uc11c\ube14\ub9bf\uc774 \ub9ce\uc740 \ud578\ub4e4\ub7ec \ub9e4\ud551\uc744 \uc0ac\uc6a9\ud558\uc5ec, \uac01\uac01\uc758 \uc694\uccad\uc744 \uc5b4\ub5a4 \ud578\ub4e4\ub7ec\uac00 \ucc98\ub9ac\ud574\uc57c\ud558\ub294\uc9c0 \uacb0\uc815\ud55c\ub2e4.\\n- \uc2a4\ud535\uc740\uc784\ubca0\ub529\ub41c \ud1b0\ucea3\uc744 \ub0b4\uc7a5\uc11c\ubc84\ub85c\uc11c \uc0ac\uc6a9\ud558\uae30 \ub54c\ubb38\uc5d0, \uc11c\ube14\ub81b, \ud544\ud130\uc640 \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \uad6c\uc131\ud558\ub294 \uc6f9 \ucef4\ud3ec\ub10c\ud2b8\ub4e4\uc758 \ud658\uacbd\uc124\uc815\uc744 web.xml\uc5d0 \uc801\ub294\ub2e4.\\n- \uc989, web.xml \ud30c\uc77c\uc548\uc5d0 \uc815\uc758\ub41c URL \ub9e4\ud551\uc744 \uae30\ubc18\uc73c\ub85c \uc801\uc808\ud55c \uc11c\ube14\ub9bf\uacfc \ud544\ud130\ub85c \uc694\uccad\uc744 \ubcf4\ub0b8\ub2e4.\\n\\n## \uc2a4\ud504\ub9c1 \ubd80\ud2b8\uc758 \ub3d9\uc791 \uc21c\uc11c\\n1. \ubc1c\uc1a1 \uc11c\ube14\ub81b\uc73c\ub85c HttpServletRequest\uc758 \uc694\uccad\uc774 \ub4e4\uc5b4\uc624\uba74, \uc694\uccad\ubc1b\uc740 URL\uc5d0 \ub9e4\ud551\ub41c \ud578\ub4e4\ub7ec \ucee8\ud2b8\ub864\ub7ec\ub97c \ud0d0\uc0c9\ud55c\ub2e4.\\n2. \ud578\ub4e4\ub7ec \uc5b4\ub311\ud130\ub85c \ucee8\ud2b8\ub864\ub7ec\uac00 \ud638\ucd9c\ub41c\ub2e4.\\n3. \ud578\ub4e4\ub7ec \uc5b4\ub311\ud130\uc5d0 \ucee8\ud2b8\ub864\ub7ec\uc758 \uc751\ub2f5\uc774 \ub3cc\uc544\uc624\uba74 ModelAndVew\ub85c \uc751\ub2f5\uc744 \uac00\uacf5\ud574 \ubc18\ud658\ud55c\ub2e4.\\n4. \ubdf0 \ud615\uc2dd\uc73c\ub85c \ub9ac\ud134\ud558\ub294 \ucee8\ud2b8\ub864\ub7ec\ub97c \uc0ac\uc6a9\ud560 \ub54c\ub294 \ubdf0 \ub9ac\uc878\ubc84\uac00 \ubdf0\ub97c \ubc18\ud658\ud55c\ub2e4.\\n\\n## \ud578\ub4e4\ub7ec \ub9e4\ud551\\n- \ud578\ub4e4\ub7ec \ub9e4\ud551 \uc778\ud130\ud398\uc774\uc2a4\ub294 \uc694\uccad \uc815\ubcf4\ub97c \uae30\uc900\uc73c\ub85c \uc5b4\ub5a4 \ucee8\ud2b8\ub864\ub7ec\ub97c \uc0ac\uc6a9\ud560 \uac83\uc778\uac00 \uacb0\uc815\ud55c\ub2e4.\\n\\n## \ud578\ub4e4\ub7ec \ub9e4\ud551\uc758 \uad6c\ud604\uccb4 \ud074\ub798\uc2a4\\n\\n### BeanNameUrlHandlerMapping\\n- \uae30\ubcf8\uc124\uc815\uac12\uc758 \ud578\ub4e4\ub7ec \ub9e4\ud551 \uad6c\ud604\uccb4\ub85c\\n- \ube48\uc758 \uc774\ub984\uc744 \uc694\uccad URL\uacfc \ub9e4\ud551\ud558\ub294\ub370 \uc0ac\uc6a9\ud55c\ub2e4.\\n- \ube48\uc744 \uc815\uc758\ud558\uba74\uc11c, \uc2ac\ub798\uc2dc(/)\uc640 \ud568\uaed8 \uc791\uc131\ub41c \uc2dd\ubcc4\uc790\uc778 \uc2ac\ub7ec\uadf8\ub97c \uc9c0\uc815\ud558\uc5ec \ub9e4\ud551\ud55c\ub2e4.\\n```\\n@Bean(\\"/hello\\")\\n```\\n- \'/hello\'\ub77c\ub294 \uc2ac\ub7ec\uadf8\uc5d0 \ube48\uc774 \ub9e4\ud551\ub418\uc5c8\ub2e4.\\n\\n- \uc774\ub7ec\ud55c \ub9e4\ud551\uc740 \uc9c1\uc811\uc801\uc778 \uc774\ub984 \ub9e4\uce6d\uacfc \\"*\\"\ud328\ud134\uc744 \uc0ac\uc6a9\ud558\ub294 \ud328\ud134 \ub9e4\uce6d\uc744 \ub3d5\ub294\ub2e4.\\n- \uc218\uc2e0\ub41c URL \\"/foo\\"\uac00 \'/foo\'\ub77c\uace0 \ubd88\ub9ac\ub294 \ube48\uc5d0 \ub9e4\ud551\ub41c\ub2e4.\\n- \ud328\ud134 \ub9e4\ud551\uc740 \\"/foo\\" \uc694\uccad\uc744 \'/foo\', \'/foo2\', \'/fooOne\' \ub4f1\uc73c\ub85c \ub9e4\uce6d\ud55c\ub2e4.\\n\\n- \uc544\ub798\ub294 \'/beanNameUrl\' \uc694\uccad\uc744 \ub2e4\ub8e8\ub294 \ube48 \ucee8\ud2b8\ub864\ub7ec\ub97c \ub4f1\ub85d\ud558\ub294 \uc18c\uc2a4\ucf54\ub4dc\uc774\ub2e4.\\n```\\n@Configuration\\npublic class BeanNameUrlHandlerMappingConfig {\\n    @Bean\\n    BeanNameUrlHandlerMapping beanNameUrlHandlerMapping() {\\n        return new BeanNameUrlHandlerMapping();\\n    }\\n\\n    @Bean(\\"/beanNameUrl\\")\\n    public WelcomeController welcome() {\\n        return new WelcomeController();\\n    }\\n}\\n```\\n- \uc774\uac83\uc774 \uc704\uc758 \uc790\ubc14 \uae30\ubc18 \ud658\uacbd \uad6c\uc131\uacfc \uac19\uc740 xml \ucf54\ub4dc\uc774\ub2e4.\\n```\\n<bean class=\\"org.springframework.web.servlet.handler.BeanNameUrlHandlerMapping\\" />\\n<bean name=\\"/beanNameUrl\\" class=\\"com.baeldung.WelcomeController\\" />\\n\\n```\\n- \uc774\ub7ec\ud55c \ud658\uacbd\uc124\uc815 \ub458 \ub2e4, BeanNameUrlHandlerMapping\uc5d0 \uad00\ud55c \ube48\uc744 \uc815\uc758\ud558\ub294 \uac83\uc774 \ud544\uc218\uac00 \uc544\ub2c8\ub2e4.\\n- \uc2a4\ud504\ub9c1 MVC\uc5d0\uc11c \ub2e4 \uc81c\uacf5\ub41c\ub2e4.\\n- \ube48 \uc815\uc758\ub97c \uc9c0\uc6b0\ub294 \uac83\uc774 \ubb38\uc81c\ub97c \ubc1c\uc0dd\uc2dc\ud0a4\uc9c0 \uc54a\uae30\uc5d0, \uc694\uccad\ub4e4\uc774 \ub4f1\ub85d\ub41c \ud578\ub4e4\ub7ec \ube48\uc5d0 \uc5ec\uc804\ud788 \ub9e4\ud551\ub420 \uac83\uc774\ub2e4.\\n- \'/beanNameUrl\'\uc758 \ubaa8\ub4e0 \uc694\uccad\uc774 \ubc1c\uc1a1 \uc11c\ube14\ub9bf\uc5d0 \uc758\ud574\uc11c \'WelcomeController\'\ub85c \ubcf4\ub0b4\uc9c4\ub2e4.\\n- \uadf8\ub7ec\uba74 \'WelcomeController\'\ub294 \'welcome\'\uc774\ub77c\ub294 \ubdf0\ub97c \ubc18\ud658\ud55c\ub2e4.\\n- \uc544\ub798\uc758 \ucf54\ub4dc\ub97c \ud1b5\ud574 \ud658\uacbd\uc124\uc815\uc744 \ud14c\uc2a4\ud2b8\ud558\uace0 \uc62c\ubc14\ub978 \ubdf0 \uc774\ub984\uc744 \ubc18\ud658\ud558\ub294\uc9c0 \ud655\uc778\ud558\uc790.\\n```\\npublic class BeanNameMappingConfigTest {\\n    // ...\\n\\n    @Test\\n    public void whenBeanNameMapping_thenMappedOK() {\\n        mockMvc.perform(get(\\"/beanNameUrl\\"))\\n          .andExpect(status().isOk())\\n          .andExpect(view().name(\\"welcome\\"));\\n    }\\n}\\n```\\n\\n### SimpleUrlHandlerMapping\\n- SimpleUrlHandlerMapping\uc740 \uc880 \ub354 \uc720\uc5f0\ud55c \ud578\ub4e4\ub7ec \ub9e4\ud551 \uad6c\ud604\uccb4\uc774\ub2e4.\\n- \uc774 \ub9e4\ud551\uc740 \ube48 \uac1d\uccb4\uc640 URL \uac04 \ub610\ub294 \ube48 \uc774\ub984\uacfc URL \uac04\uc758 \uc9c1\uc811\uc801\uc774\uace0 \uc120\uc5b8\uc801\uc778 \ub9e4\ud551\uc774\ub2e4.\\n- \\"/simpleUrlWelcome\\"\uacfc \\"/*/simpleUrlWelcome\\" \uc694\uccad\uc744 \'welcome\' \ube48\uc73c\ub85c \ub9e4\ud551\ud574\ubcf4\uc790.\\n```\\n@Configuration\\npublic class SimpleUrlHandlerMappingConfig {\\n\\n    @Bean\\n    public SimpleUrlHandlerMapping simpleUrlHandlerMapping() {\\n        SimpleUrlHandlerMapping simpleUrlHandlerMapping\\n          = new SimpleUrlHandlerMapping();\\n        \\n        Map<String, Object> urlMap = new HashMap<>();\\n        urlMap.put(\\"/simpleUrlWelcome\\", welcome());\\n        simpleUrlHandlerMapping.setUrlMap(urlMap);\\n        \\n        return simpleUrlHandlerMapping;\\n    }\\n\\n    @Bean\\n    public WelcomeController welcome() {\\n        return new WelcomeController();\\n    }\\n}\\n```\\n- XML \ud658\uacbd\uc124\uc815\uc5d0\uc11c\ub3c4 \uc544\ub798\uc640 \uac19\uc774 \ub611\uac19\uc774 \uc124\uc815\ud560 \uc218 \uc788\ub2e4.\\n```\\n<bean class=\\"org.springframework.web.servlet.handler.SimpleUrlHandlerMapping\\">\\n    <property name=\\"mappings\\">\\n        <value>\\n            /simpleUrlWelcome=welcome\\n            /*/simpleUrlWelcome=welcome\\n        </value>\\n    </property>\\n</bean>\\n<bean id=\\"welcome\\" class=\\"com.baeldung.WelcomeController\\" />\\n```\\n- XML \ud658\uacbd\uc124\uc815\uc744 \ub2e4\uc74c\uacfc \uac19\uc740 \uac83\ub4e4\uc774 \uc911\uc694\ud558\ub2e4. java.util.Properties \ud074\ub798\uc2a4\uc5d0 \uc758\ud574 \ubc1b\uc544\uc9c0\ub294 \ud3fc\uc5d0\uc11c < value > \ud0dc\uadf8 \uc0ac\uc774\uc758 \ub9e4\ud551\uc774 \uc774\ub8e8\uc5b4\uc9c4\ub2e4.\\n- \ub9e4\ud551\uc744 \ud560 \ub54c\ub294 path = Handler_Bean_Name \uc758 \uaddc\uce59\uc744 \ub530\ub978\ub2e4.\\n- URL\uc774 \ubcf4\ud1b5 \ub9ac\ub529 \uc2ac\ub798\uc2dc\uc640 \ud568\uaed8 \uc791\uc131\ub418\uc9c0\ub9cc, \uacbd\ub85c\uac00 \ud558\ub098\ub85c \uc2dc\uc791\ud558\ub294 \uac8c \uc544\ub2c8\ub77c\uba74 \uc2a4\ud504\ub9c1 MVC\ub294 \uc790\ub3d9\uc73c\ub85c \ucd94\uac00\ud574\uc900\ub2e4.\\n\\n- XML\uc5d0 \uc704\uc758 \uc608\ub97c \uc124\uc815\ud558\ub294 \ub2e4\ub978 \ubc29\ubc95\uc740 \'props\' \uc18d\uc131\uc744 \'value\' \uc18d\uc131\uc744 \ub300\uc2e0\ud574 \uc0ac\uc6a9\ud558\ub294 \uac83\uc774\ub2e4.\\n- Props\uc740 prop\ud0dc\uadf8\uc758 \ub9ac\uc2a4\ud2b8\ub97c \uac00\uc9c4\ub2e4.\\n- prop\ud0dc\uadf8\ub97c \ud1b5\ud574\uc11c \ub9e4\ud551\ud558\ub294\ub370, \'key\'\uac00 \ub9e4\ud551\ub41c URL\uc744 \ucc38\uc870\ud558\uace0 \ud0dc\uadf8\uc758 \uac12\uc774 \ube48\uc758 \uc774\ub984\uc774\ub2e4.\\n```\\n<bean class=\\"org.springframework.web.servlet.handler.SimpleUrlHandlerMapping\\">\\n    <property name=\\"mappings\\">\\n        <props>\\n            <prop key=\\"/simpleUrlWelcome\\">welcome</prop>\\n            <prop key=\\"/*/simpleUrlWelcome\\">welcome</prop>\\n        </props>\\n    </property>\\n</bean>\\n```\\n- \uc544\ub798 \ud14c\uc2a4\ud2b8 \ucf54\ub4dc\uac00 \\"/simpleUrlWelcome\\" \uc694\uccad\uc774 \'welcome\' \ubdf0\ub97c \ubc18\ud658\ud558\ub294 \'WelcomeController\'\uc5d0 \uc758\ud574 \ud578\ub4e4\ub418\ub294\uc9c0 \ud655\uc778\ud55c\ub2e4.\\n```\\npublic class SimpleUrlMappingConfigTest {\\n    // ...\\n\\n    @Test\\n    public void whenSimpleUrlMapping_thenMappedOK() {\\n        mockMvc.perform(get(\\"/simpleUrlWelcome\\"))\\n          .andExpect(status().isOk())\\n          .andExpect(view().name(\\"welcome\\"));\\n    }\\n}\\n```\\n\\n### ControllerClassNameHandlerMapping\\n- URL\uacfc \uc77c\uce58\ud558\ub294 \ud074\ub798\uc2a4 \uc774\ub984\uc744 \uac16\ub294 \ube48\uc744 \ucee8\ud2b8\ub864\ub7ec\ub85c \uc0ac\uc6a9\ud55c\ub2e4.\\n- ControllerClassNameHandlerMapping\uc740 URL\uc744 \ub4f1\ub85d\ub41c \ucee8\ub4dc\ub864\ub7ec \ube48(@Controller \uc8fc\uc11d\uc774 \uc5b8\uae09\ub41c \ucee8\ud2b8\ub864\ub7ec)\uc5d0 \ub9e4\ud551\ud55c\ub2e4.\\n- \ucee8\ud2b8\ub864\ub7ec\uc758 \uc774\ub984\uc740 \uac19\uc740 \uc774\ub984\uc744 \uac00\uc9c0\uac70\ub098 \uadf8 \uc774\ub984\uc73c\ub85c \uc2dc\uc791\ud55c\ub2e4.\\n\\n- \ub9ce\uc740 \uacbd\uc6b0\uc5d0\uc11c \ub354 \ud3b8\ub9ac\ud560 \uc218 \uc788\ub294\ub370, \ud2b9\ud788 \ud558\ub098\uc758 \uc694\uccad \ud615\uc744 \ud578\ub4e4\ub9c1\ud558\ub294 \ub2e8\uc21c\ud55c \ucee8\ud2b8\ub864\ub7ec \uad6c\ud604\uccb4\uc5d0 \uacbd\uc6b0 \ub354\uc6b1 \ud3b8\ub9ac\ud558\ub2e4.\\n- \uc2a4\ud504\ub9c1 MVC\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \uaddc\uce59\uc740 \uc774\ub984\uc5d0\uc11c Controller\ub97c \uc81c\uc678\ud558\uace0 \uc811\ubbf8\uc0ac\ub97c \uc18c\ubb38\uc790\ub85c \\"/\\"\uc744 \ubd99\uc5ec\uc11c \ub9e4\ud551\ud55c\ub2e4.\\n- \\"WelcomeController\\"\ub294 \\"/welcome*\\"\uc744 \ub9e4\ud551\ud55c\ub2e4. \uc989, \\"welcome\\"\uc73c\ub85c \uc2dc\uc791\ud558\ub294 \uc5b4\ub5a0\ud55c URL\uc774 \ub9e4\ud551\ub41c\ub2e4.\\n```\\n@Configuration\\npublic class ControllerClassNameHandlerMappingConfig {\\n\\n    @Bean\\n    public ControllerClassNameHandlerMapping controllerClassNameHandlerMapping() {\\n        return new ControllerClassNameHandlerMapping();\\n    }\\n\\n    @Bean\\n    public WelcomeController welcome() {\\n        return new WelcomeController();\\n    }\\n}\\n```\\n- ControllerClassNameHandlerMapping\uc774 \uc2a4\ud504\ub9c1 4.3\uc5d0\uc11c \uc0ac\ub77c\uc9c0\uac8c\ub418\uc5c8\ub2e4. \uc8fc\uc11d \uc8fc\ub3c4 \ud578\ub4e4\ub7ec \ubc29\ubc95\uc774 \uc120\ud638\ub418\uc5b4\uc9c0\uae30 \ub54c\ubb38\uc774\ub2e4.\\n- \ucee8\ud2b8\ub864\ub7ec \uc774\ub984\uc774 \ud56d\uc0c1 \ucee8\ud2b8\ub864\ub7ec \uc811\ubbf8\uc0ac\ub97c \uc9c0\uc6b0\uace0 \uc18c\ubb38\uc790\ub85c \ubc18\ud658\ud55c\ub2e4\ub294 \uac83\ub3c4 \uc911\uc694\ud558\ub2e4.\\n- \ub530\ub77c\uc11c \'/welcomTaehwan\'\uc740 \uc694\uccad\uc5d0\uc11c \ucc98\ub9ac\ud558\uc9c0 \ubabb\ud558\uace0 \'/welcometaehwan\'\uc758 \uc694\uccad\ub9cc \ucc98\ub9ac\ud560 \uc218 \uc788\ub2e4.\\n- \uc790\ubc14\uc640 \uc544\ub798\uc758 XML \ud658\uacbd\uc124\uc815 \ubaa8\ub450\uc5d0\uc11c, ControllerClassNameHandlerMapping \ube48\uc744 \uc815\uc758\ud558\uace0 \uc694\uccad\uc744 \ucc98\ub9ac\ud560 \ub54c \uc0ac\uc6a9\ud560 \ucee8\ud2b8\ub864\ub7ec\uc5d0 \ube48\uc744 \ub4f1\ub85d\ud55c\ub2e4. \\n- \'/welcome\'\uc73c\ub85c \uc2dc\uc791\ud558\ub294 \uc694\uccad\uc744 \ud578\ub4e4\ub9c1\ud558\ub294 \\"WelcomeControlle\\"\ub97c XML\ub85c \ub9cc\ub4e4\uc5b4\ubcf4\uc790.\\n```\\n@Configuration\\npublic class ControllerClassNameHandlerMappingConfig {\\n\\n    @Bean\\n    public ControllerClassNameHandlerMapping controllerClassNameHandlerMapping() {\\n        return new ControllerClassNameHandlerMapping();\\n    }\\n\\n    @Bean\\n    public WelcomeController welcome() {\\n        return new WelcomeController();\\n    }\\n}\\n```\\n- \uc704\uc758 XML \ud658\uacbd\uc124\uc815\uc744 \uc0ac\uc6a9\ud558\uba74, \'/welcome\'\uc5d0 \ub300\ud55c \uc694\uccad\uc774 \\"WelcomeController\\"\uc5d0 \uc758\ud574\uc11c \ud578\ub4e4\ub9c1\ub41c\ub2e4.\\n- \uc544\ub798 \ucf54\ub4dc\ub294 \\"welcometest\\"\uacfc \uac19\uc740 \\"/welcome*\\" \uc694\uccad\uc774 \'WelcomeController\'\uc5d0 \uc758\ud574\uc11c \ud578\ub4e4\ub9c1\uc774 \ub418\ub294\uc9c0 \ud14c\uc2a4\ud2b8\ud558\uace0 welcome\' \uc774\ub984\uc758 \ubdf0\ub97c \ubc18\ud658\ud558\ub294\uc9c0 \ud655\uc778\ud55c\ub2e4.\\n```\\npublic class ControllerClassNameHandlerMappingTest {\\n    // ...\\n\\n    @Test\\n    public void whenControllerClassNameMapping_thenMappedOK() {\\n        mockMvc.perform(get(\\"/welcometest\\"))\\n          .andExpect(status().isOk())\\n          .andExpect(view().name(\\"welcome\\"));\\n    }\\n}\\n```\\n\\n### DefaultAnnotationHandlerMapping\\n- \uc5b4\ub178\ud14c\uc774\uc158\uc73c\ub85c URL\uacfc \ucee8\ud2b8\ub864\ub7ec\ub97c \ub9e4\ud551\ud55c\ub2e4.\\n- \ub4e4\uc5b4\uc624\ub294 HTTP \uc694\uccad\uc744 \uc8fc\uc11d\uc774 \uc788\ub294 \ucee8\ud2b8\ub864\ub7ec \uc911\uc5d0 \uc801\uc808\ud55c \uac83\uc73c\ub85c \ubcf4\ub0b4\uc900\ub2e4.\\n- \uc694\uccad\uc774 \ub4e4\uc5b4\uc624\uba74, DefaultAnnotationHandlerMapping\uc774 \uc2a4\ud504\ub9c1 ApplicationContext\uc5d0 \ub4f1\ub85d\ub41c \ubaa8\ub4e0 \ube48\uc744 \uc2a4\uce94\ud574\uc11c \'@RequestMapping\', \'@GetMapping\', \'@PostMapping\'\uc774\ub098 \ube44\uc2b7\ud55c \uc5b4\ub178\ud14c\uc774\uc158\uc744 \uac16\ub294 \ube48\uc744 \ubaa8\ub450 \ucc3e\ub294\ub2e4.\\n- \uadf8\ub9ac\uace0 \uc774 \uc815\ubcf4\ub97c \ud65c\uc6a9\ud574\uc11c \uc5b4\ub5a4 \ucee8\ud2b8\ub864\ub7ec\uac00 \uc694\uccad\uc744 \ud578\ub4e4\ub9c1\ud560 \uc9c0 \uacb0\uc815\ud55c\ub2e4.\\n- \ub610\ud55c DefaultAnnotationHandlerMapping\uc740 \ub9e4\ud551 \ucc98\ub9ac\uc758 \ub3d9\uc791\uc744 \ucee4\uc2a4\ud130\ub9c8\uc774\uc9d5\ud558\ub294 \ub9ce\uc740 \uc5b4\ub178\ud14c\uc774\uc158\ub3c4 \uc9c0\uc6d0\ud55c\ub2e4. (e.g. \'@PathVariable\', \'@RequestParam\', \'@RequestBody\')\\n- \uae30\ubcf8\uc124\uc815\uc73c\ub85c, DefaultAnnotationHandlerMapping\uc774 \uc2a4\ud504\ub9c1 MVC \uad6c\uc131\uc5d0 \ud3ec\ud568\ub418\uc5b4 \ub4e4\uc5b4\uc624\ub294 HTTP \uc694\uc744 \ud578\ub4e4\ub9c1\ud558\ub294\ub370 \uc0ac\uc6a9\ub41c\ub2e4.\\n- \ud558\uc9c0\ub9cc \ud544\uc694\ud558\ub2e4\uba74, \ub2e4\ub978 \ub9e4\ud551 \uc804\ub7b5\uc73c\ub85c \ub300\uccb4\ub418\uac70\ub098 \ucee4\uc2a4\ud130\ub9c8\uc774\uc9d5 \ub420 \uc218 \uc788\ub2e4.\\n\\n\\n\\n# Refference\\n- [Baeldung](https://www.baeldung.com/spring-handler-mappings)"},{"id":"pandas-2-feature-1","metadata":{"permalink":"/blog/pandas-2-feature-1","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2023-03-24-pandas2/2023-03-24-pandas2.md","source":"@site/blog/2023-03-24-pandas2/2023-03-24-pandas2.md","title":"\ub118\ud30c\uc774\uc640 \uce5c\ud574\uc9c4 \ud310\ub2e4\uc2a4 2.0","description":"\ub2e4\uc591\ud55c \uc790\ub8cc\ud615\uc744 \uc9c0\uc6d0\ud558\ub294 \uc778\ub371\uc2a4","date":"2023-03-24T00:00:00.000Z","formattedDate":"2023\ub144 3\uc6d4 24\uc77c","tags":[{"label":"eda","permalink":"/blog/tags/eda"},{"label":"pandas","permalink":"/blog/tags/pandas"}],"readingTime":2.825,"hasTruncateMarker":false,"authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"frontMatter":{"slug":"pandas-2-feature-1","title":"\ub118\ud30c\uc774\uc640 \uce5c\ud574\uc9c4 \ud310\ub2e4\uc2a4 2.0","authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"tags":["eda","pandas"]},"unlisted":false,"prevItem":{"title":"\uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uac1c\ubc1c\uc758 \uae30\ucd08 \uc0c1\uc2dd","permalink":"/blog/spring-boot-dev-basic"},"nextItem":{"title":"Docusaurus \uae43\ud5c8\ube0c \ud398\uc774\uc9c0 \ud638\uc2a4\ud305\ud558\uae30","permalink":"/blog/docusaurus-deploy"}},"content":"## \ub2e4\uc591\ud55c \uc790\ub8cc\ud615\uc744 \uc9c0\uc6d0\ud558\ub294 \uc778\ub371\uc2a4\\n- \uc778\ub371\uc2a4\uac00 dtype \uc18d\uc131\uc5d0\uc11c \ub354\ub9ce\uc740 \ub118\ud30c\uc774 \uc22b\uc790 \uc790\ub8cc\ud615\uc73c\ub85c \uc9c0\uc815\ud560 \uc218 \uc788\ub2e4. (e.g. np.int8, np.unit32, float32)\\n\\t- \uae30\uc874\uc5d0\ub294 np.int64, np.uint64\uc640 np.float64\ub9cc\uc774 \uc9c0\uc815\uac00\ub2a5\ud588\ub2e4.\\n![](./pandas1.5-numeric-dtype.png)\\n- \uae30\uc874\uc5d0\ub294 \uc778\ub371\uc2a4\uc758 \uc790\ub8cc\ud615\uc774 int, uint, flaot\uc73c\ub85c\ub9cc \uc9c0\uc815\ub418\uace0,\\n- 64\ube44\ud2b8\ub85c\ub9cc \uc9c0\uc815\uc774 \uac00\ub2a5\uc73c\uba70 Int64Index \ub4f1\uc73c\ub85c \ud45c\ud604\ub418\uc5c8\ub2e4.\\n- \ud310\ub2e4\uc2a42.0 \ubd80\ud130\ub294 \ub2e4\uc591\ud55c \ube44\ud2b8\uc758 \uc22b\uc790 \uc790\ub8cc\ud615\uc744 \uc778\ub371\uc2a4\ub97c \uc9c0\uc6d0\ud558\uac8c \ub418\uc5c8\ub2e4.\\n- \uadf8\ub9ac\uace0 \uc778\ub371\uc2a4\uc758 \uc774\ub984\ub3c4 Index\ub85c \ud1b5\uc77c\ub418\uc5c8\ub2e4.\\n\\n![](./pandas2.0-numeric-dtype.png)\\n- \uc778\ub371\uc2a4\uac00 \ub354 \ub118\ud30c\uc774 \uc22b\uc790 \uc790\ub8cc\ud615\uc744 \uac00\uc9c8 \uc218 \uc788\uc5b4, \ud310\ub2e4\uc2a4 \uae30\ub2a5\uc5d0 \ubcc0\ud654\uac00 \uc0dd\uacbc\ub2e4.\\n- \ud2b9\ud788 64\ube44\ud2b8\ub85c \uc0dd\uc131\ud558\ub3c4\ub85d \uac15\uc81c\ub418\uc5c8\ub358 \uc791\uc5c5\ub4e4\uc774 \uc774\uc81c\ub294 \uc791\uc740 \ube44\ud2b8 \uc0ac\uc774\uc988\ub97c \uac16\ub294 \uc778\ub371\uc2a4\ub97c \uc0dd\uc131\ud558\uac8c \ub418\uc5c8\ub2e4.\\n## \ub118\ud30c\uc774 \uc22b\uc790 \uc790\ub8cc\ud615\uc73c\ub85c \ub2ec\ub77c\uc9c4 \uc791\uc5c5\\n### \ub118\ud30c\uc774 \ubc30\uc5f4\\n- \ub118\ud30c\uc774 \uc22b\uc790\ud615 \ubc30\uc5f4\uc744 \uc778\uc2a4\ud134\uc2a4\ud654 \uc2dc\ud0ac \ub54c \ub118\ud30c\uc774 \ubc30\uc5f4\uc758 \uc790\ub8cc\ud615\uc744 \ub530\ub974\uac8c \ub41c\ub2e4.\\n- \uc774\uc804\uc5d0\ub294, \ubaa8\ub4e0 \uc778\ub371\uc2a4\ub4e4\uc774 64\ube44\ud2b8\ub85c \uac15\uc81c\ub41c \ub118\ud30c\uc774 \uc22b\uc790 \ubc30\uc5f4\ub85c \uc0dd\uc131\ub418\uc5c8\ub2e4.\\n![](./pandas1.5-arry-numeric-dtype.png)\\n### \uc22b\uc790 \ub0a0\uc9dc \uc18d\uc131\uc758 DatetimeIndex \\n- \ud310\ub2e4\uc2a4 2.0 \uc774\uc804\uc5d0\ub294 DatetimeIndex(day, month, year)\uc758 \uc790\ub8cc\ud615\uc774 int64\uc774\ub2e4.\\n- \ubc18\uba74\uc5d0 arrays.DatetimeArray\uc5d0\uc11c\ub294 32\ube44\ud2b8\uc774\ub2e4. \\n- 2.0 \uc774\ud6c4 \ubc84\uc804\uc5d0\uc11c\ub294 DatetimeIndex\uac00 int32 \uc790\ub8cc\ud615\uc73c\ub85c \ubcc0\uacbd\ub418\uba74\uc11c \ud1b5\uc77c\ub418\uc5c8\ub2e4.\\n![](./pandas2.0-datetime-dtype.png)\\n\\n### Series.sparse.from_coo()\uac00 int32\ub97c \uc9c0\uc6d0\ud55c\ub2e4.\\n- Series.sparse.from_coo()\uc758 \uc778\ub371\uc2a4\uc758 \ub808\ubca8 \uc790\ub8cc\ud615\uc774 int32 \uc790\ub8cc\ud615\uc774 \ub418\uc5c8\ub2e4.\\n- 2.0\ubc84\uc804 \uc774\uc804\uc5d0\ub294 \ud589\uacfc \uc5f4 \ubaa8\ub450 int64 \uc790\ub8cc\ud615\uc744 \uac00\uc84c\ub2e4.\\n![](./1.5-sparse-matrix-dtype.png)\\n- 2.0 \ubc84\uc804\ubd80\ud130\ub294 \ud589\uacfc \uc5f4\uc758 \uc790\ub8cc\ud615\uc774 int32\ub85c \ubc14\uaf08\ub2e4.\\n![](./2.0-sparse-matrix-dtype.png)\\n\\n### Index\uac00 float16 dtype\uc73c\ub85c \uc778\uc2a4\ud134\uc2a4\ud654 \uc2dc\ud0ac \uc218 \uc5c6\ub2e4.\\n- \uc774\uc804 \ubc84\uc804\uc5d0\uc11c\ub294 Index\ub97c float16\uc758 \uc790\ub8cc\ud615\uc73c\ub85c \uc778\uc2a4\ud134\uc2a4\ud654 \uc2dc\ud0a4\uba74 Float64Index\ub85c \uc0dd\uc131\ub418\uc5c8\ub2e4.\\n- \uc774\uc81c float16\uc73c\ub85c \uc790\ub8cc\ud615\uc744 \uc124\uc815\ud55c Index \uc778\uc2a4\ud134\uc2a4\ub294 NotImplementedError\uc758 \uc5d0\ub7ec\ub97c \ubc1c\uc0dd\ud55c\ub2e4.\\n![](./NotImplementedError.png)\\n\\n- \ub2e4\uc74c \ubcc0\uacbd\uc810\ub4e4\uc740 \ud558\ub098\uc529 \ud3ec\uc2a4\ud305 \ud574\ubcf4\uaca0\ub2e4. \uadf8\ub7fc \uc774\ub9cc\\n\\n\\n## refference\\n[\ud310\ub2e4\uc2a4 \uacf5\uc2dd \ud398\uc774\uc9c0](https://pandas.pydata.org/docs/dev/whatsnew/v2.0.0.html)"},{"id":"docusaurus-deploy","metadata":{"permalink":"/blog/docusaurus-deploy","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2023-03-23-docusaurus-deploy/2023-03-23-docusaurus-deploy.md","source":"@site/blog/2023-03-23-docusaurus-deploy/2023-03-23-docusaurus-deploy.md","title":"Docusaurus \uae43\ud5c8\ube0c \ud398\uc774\uc9c0 \ud638\uc2a4\ud305\ud558\uae30","description":"- \uae43\ud5c8\ube0c \ud398\uc774\uc9c0\uc5d0 Docusaurus \ube14\ub85c\uadf8 \uc0ac\uc774\ud2b8\ub97c \uc11c\ube44\uc2a4\ud574\ubcf4\uc790.","date":"2023-03-23T00:00:00.000Z","formattedDate":"2023\ub144 3\uc6d4 23\uc77c","tags":[{"label":"web","permalink":"/blog/tags/web"},{"label":"blog","permalink":"/blog/tags/blog"},{"label":"writing","permalink":"/blog/tags/writing"}],"readingTime":4.305,"hasTruncateMarker":false,"authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"frontMatter":{"slug":"docusaurus-deploy","title":"Docusaurus \uae43\ud5c8\ube0c \ud398\uc774\uc9c0 \ud638\uc2a4\ud305\ud558\uae30","authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"tags":["web","blog","writing"]},"unlisted":false,"prevItem":{"title":"\ub118\ud30c\uc774\uc640 \uce5c\ud574\uc9c4 \ud310\ub2e4\uc2a4 2.0","permalink":"/blog/pandas-2-feature-1"},"nextItem":{"title":"\uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uad6c\uc131\uc694\uc18c \uc0b4\ud3b4\ubcf4\uae30","permalink":"/blog/spring-boot-component-research"}},"content":"- \uae43\ud5c8\ube0c \ud398\uc774\uc9c0\uc5d0 Docusaurus \ube14\ub85c\uadf8 \uc0ac\uc774\ud2b8\ub97c \uc11c\ube44\uc2a4\ud574\ubcf4\uc790. \\n\\n# \ubaa9\uc801\\n- GitHub \ube14\ub85c\uadf8\ub97c \ub9cc\ub4e4\uc5b4\ubcf4\uc790.\\n- Docusaurus\ub97c \uc0ac\uc6a9\ud574\ubcf4\uc790.\\n\\n# \uc791\uc5c5\uc21c\uc11c\\n![](./docusaurus-deploy.png)\\n1. \uae43\ud5c8\ube0c \ube14\ub85c\uadf8 repo \uc0dd\uc131\\n2. \uac1c\ubc1c\ud658\uacbd \uad6c\ucd95\\n3. Docusaurus \uc124\uce58\\n4. \ub85c\uceec\uc5d0\uc11c \uc11c\ube44\uc2a4\\n5. \uae43\ud5c8\ube0c \ud398\uc774\uc9c0\uc5d0 \ubc30\ud3ec\\n\\n# \uae43\ud5c8\ube0c \ube14\ub85c\uadf8 repo \uc0dd\uc131\\n![](./git-hub-repo-generation.png)\\n- Repo \uc774\ub984\uc740 github \uc544\uc774\ub514.github.io\ub85c \uc791\uc131\ud55c\ub2e4.\\n- Public \uc0c1\ud0dc\ub85c \uc124\uc815\ub41c \uac78 \ud655\uc778\ud558\uace0 \uc0dd\uc131\ud55c\ub2e4.\\n\\n# \uac1c\ubc1c\ud658\uacbd \uad6c\ucd95\\n- Docusaurus \ube14\ub85c\uadf8\ub97c \uad6c\ucd95\ud558\uae30 \uc704\ud574\uc11c\ub294 Node.js, npm, yarn, git \ub4f1\uc774 \ud544\uc694\ud558\ub2e4. \ud558\ub098\uc529 \ub530\ub77c\ud574\ubcf4\uc790.\\n\\n## Node.js\\n- \ud130\ubbf8\ub110(CLI)\uc744 \ucf1c\uace0, Node.js\uc758 \ubc84\uc804\uc744 \ud655\uc778\ud558\uc790.\\n- macOS\uc758 \ud130\ubbf8\ub110\uc5d0\uc11c\ub294 node -v \uba85\ub839\uc5b4\ub97c \ud1b5\ud574 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n- Docusaurus v2.3.1(2023.3\uc6d4 \uae30\uc900)\uc5d0\ub294 v16.14 \uc774\uc0c1\uc758 Node.js\uac00 \uc124\uce58\ub418\uc5b4\uc57c \ud55c\ub2e4.\\n- nvm\uc744 \ud1b5\ud574\uc11c \uc124\uce58\ub098 \ubc84\uc804\uc744 \uad00\ub9ac\ud560 \uc218 \uc788\ub2e4.\\n- \uc544\ub798\uc640 \uac19\uc740 \uba85\ub839\uc5b4\ub97c \ud1b5\ud574 \ucd5c\uc2e0\ubc84\uc804\uc73c\ub85c \uad00\ub9ac\ud560 \uc218 \uc788\ub2e4.\\n\\n```\\nnpm install -g npm\\n```\\n\\n## NPM\\n- \uc704\uc758 \uba85\ub839\uc5b4\ub85c npm\uc774 \uc124\uce58\ub418\uba74 node.js\uc640 npm\uc774 \uc124\uce58\uac00 \ub41c\ub2e4.\\n- npm -v \uba85\ub839\uc5b4\ub97c \ud1b5\ud574 \ubc84\uc804\ub3c4 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n- npm\uc740 docusaurus\ub97c \ub85c\uceec\uc5d0\uc11c \ud14c\uc2a4\ud2b8\ud560 \ub54c \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n## Yarn\\n- Yarn\uc744 \ud1b5\ud574\uc11c \uc6b0\ub9ac\ub294 \ube4c\ub4dc\ud558\uace0 \ubc30\ud3ec\ud55c\ub2e4.\\n```\\nnpm install --global yarn\\n```\\n- \ub2e4\uc74c\uacfc \uac19\uc774 yarn\uc744 \uc124\uce58\ud55c\ub2e4.\\n- \uc124\uce58\uac00 \uc798 \ub410\ub294\uc9c0, \ubc84\uc804\uc744 \ud655\uc778\ud558\uae30 \uc704\ud574\uc11c \uc544\ub798 \uba85\ub839\uc5b4\ub97c \uc785\ub825\ud574\ubcf4\uc790.\\n```\\nyarn --version\\n```\\n\\n# Git\\n- \uc55e\uc11c \uc0dd\uc131\ud55c repo\ub97c \ub85c\uceec\uc5d0 \ud074\ub860\uc744 \ub5a0\uc640\uc11c \uc791\uc5c5\ud55c\ub2e4.\\n![](./github-ssh-code.png)\\n- \uc704\uc758 \ud654\uba74\uac19\uc774 \ucf54\ub4dc\uc758 SSH\ucf54\ub4dc\ub97c \ubcf5\uc0ac\ud558\uc790.\\n- CLI\ub97c \ud1b5\ud558\uc5ec \ud074\ub860 \ud3f4\ub354\ub97c \uac00\uc9c8 \ub85c\uceec \ud3f4\ub354\uc5d0 \uac00\uc11c \uc544\ub798\uc758 \uba85\ub839\uc5b4\ub97c \ud1b5\ud574 \ud074\ub860\uc744 \uc9c4\ud589\ud55c\ub2e4.\\n```\\ngit clone {SSH \ucf54\ub4dc}\\n```\\n- \uc911\uad04\ud638 \uc5c6\uc774 SSH \ucf54\ub4dc\ub97c \uc785\ub825\ud55c\ub2e4.\\n- \uadf8\ub7ec\uba74 \ub85c\uceec\uc5d0 000.github.io repo \ud074\ub860\uc774 \uc800\uc7a5\ub418\uc5c8\uace0, repo\uc5d0 \uc5f0\uacb0\ub41c\ub2e4.\\n\\n- \uc774\uc81c \ub2e4\uc74c \ub2e8\uacc4\ub85c \ub118\uc5b4\uac00\uc790\\n\\n# Docusaurus \uc124\uce58\ud558\uae30\\n```\\nnpx create-docusaurus@latest my-website classic\\n```\\n- \ud130\ubbf8\ub110\ud604\uc7ac \uacbd\ub85c\uc5d0\uc11c my-website \ud3f4\ub354\uac00 \uc124\uce58\ub41c\ub2e4.\\n- \ud574\ub2f9 \ud3f4\ub354 \uc548\uc758 \ud3f4\ub354\uc640 \ud30c\uc77c\ub4e4\uc744 \ubaa8\ub450 \ubcf5\uc0ac\ud574 \ud074\ub860 repo\uc778 000.github.io \ud3f4\ub354 \uc548\uc5d0 \ubd99\uc5ec\ub123\ub294\ub2e4.\\n- \uc544\ub798\uc640 \uac19\uc774 \uae43 \ud5c8\ube0c\uc5d0 add / commit / push\ub97c \ud574\ubcf4\uc790.\\n```\\ngit add .\\n```\\n```\\ngit commit -m \'test\'\\n```\\n```\\ngit push\\n```\\n\\n## \ub85c\uceec\uc5d0\uc11c docusaurus \uc11c\ube44\uc2a4 \ud14c\uc2a4\ud2b8\\n- \ub2e4\uc2dc CLI\uc5d0\uc11c 000.github.io \ud3f4\ub354\uc5d0 \uc811\uadfc\ud558\uc5ec \uc544\ub798 \uba85\ub839\uc5b4\ub97c \uc785\ub825\ud55c\ub2e4.\\n```\\nyarn run start\\n```\\n- \uadf8\ub7ec\uba74 http://localhost:3000 \ub85c\uceec url\uc744 \ud1b5\ud574\uc11c \uc811\uc18d\ud560 \uc218 \uc788\ub2e4.\\n\\n## \uae43\ud5c8\ube0c \ud398\uc774\uc9c0\uc5d0 \ud638\uc2a4\ud305\ud558\uae30\\n- docusaurus\ub97c \ud638\uc2a4\ud305\ud558\ub294 \ub2e4\uc591\ud55c \ubc29\ubc95\uc774 \uc788\uc9c0\ub9cc, \uc5ec\uae30\uc11c\ub294 \uae43\ud5c8\ube0c\ud398\uc774\uc9c0\uc5d0 \ud638\uc2a4\ud305\ud55c\ub2e4.\\n- \uba3c\uc800 \ube4c\ub4dc\ub97c \ud574\uc57c\ub41c\ub2e4.\\n```\\nyarn build\\n```\\n- \uc774\ub807\uac8c \ud558\uba74 build \ud3f4\ub354\uc548\uc5d0 \ucf58\ud150\uce20\ub4e4\uc774 \ub9cc\ub4e4\uc5b4\uc9c4\ub2e4. \uc774\uc81c \ud638\uc2a4\ud305\uc5d0 \ubc30\ud3ec\ud574\ubcf4\uc790.\\n```\\nGIT_USER={\uae43\ud5c8\ube0c \uc720\uc800\uba85} USE_SSH=true yarn deploy\\n```\\n- \uc774\ub807\uac8c \ud558\uba74 gh-pages\ub77c\ub294 \ube0c\ub79c\uce58\uac00 \uc0dd\uc131\ub41c\ub2e4.\\n- \uc5ec\uae30 \uae4c\uc9c0 \ud588\ub2e4\uba74 \uae43\ud5c8\ube0c repo\uc758 page \uc124\uc815\uc744 \ub2e4\uc2dc \ud655\uc778\ud574\ubcf4\uc790.\\n![](./Github-pages-setting.png)\\n- \uadf8\ub9bc\uacfc \uac19\uc774 \ud398\uc774\uc9c0 \uc124\uc815\uc5d0 \ub4e4\uc5b4\uac00\uc11c, gh-pages\ub77c\ub294 \ube0c\ub79c\uce58\ub85c \uc800\uc7a5\ud55c\ub2e4.\\n\\n- \uc774\uc81c 000.github.io\uc5d0 \uc811\uc18d\ud574\ubcf4\uc790.\\n- \uc774\uc81c \ub0b4\uc6a9\uc744 \uafb8\uba70\ubcf4\uc790.\\n\\n# refference\\n- [docusaurus installation](https://docusaurus.io/docs/installation)\\n- [docusaurus documentation](https://github.com/dochavez/Documenting-with-Docusaurus-V2.-)"},{"id":"spring-boot-component-research","metadata":{"permalink":"/blog/spring-boot-component-research","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2023-03-23-spring-boot/2023-03-23-spring-boot.md","source":"@site/blog/2023-03-23-spring-boot/2023-03-23-spring-boot.md","title":"\uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uad6c\uc131\uc694\uc18c \uc0b4\ud3b4\ubcf4\uae30","description":"- \ubc31\uc5d4\ub4dc\ub97c \ubc30\uc6cc\ubcf8 \uc801\uc774 \uc5c6\ub294 \ud559\uc0dd\uc774 \uae40\uc601\ud55c \uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uc785\ubb38 \uac15\uc758\ub97c \ub4e3\uace0 \uc791\uc131\ud55c \uae00\uc774\ub2e4.","date":"2023-03-23T00:00:00.000Z","formattedDate":"2023\ub144 3\uc6d4 23\uc77c","tags":[{"label":"data","permalink":"/blog/tags/data"}],"readingTime":10.525,"hasTruncateMarker":false,"authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"frontMatter":{"slug":"spring-boot-component-research","title":"\uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uad6c\uc131\uc694\uc18c \uc0b4\ud3b4\ubcf4\uae30","authors":[{"name":"\uc774\ud0dc\ud658","title":"\uac1c\ubc1c\uc790","url":"https://github.com/leetaehwan","image_url":"https://github.com/leetaehwan.png","imageURL":"https://github.com/leetaehwan.png"}],"tags":["data"]},"unlisted":false,"prevItem":{"title":"Docusaurus \uae43\ud5c8\ube0c \ud398\uc774\uc9c0 \ud638\uc2a4\ud305\ud558\uae30","permalink":"/blog/docusaurus-deploy"},"nextItem":{"title":"Greetings!","permalink":"/blog/greetings"}},"content":"- \ubc31\uc5d4\ub4dc\ub97c \ubc30\uc6cc\ubcf8 \uc801\uc774 \uc5c6\ub294 \ud559\uc0dd\uc774 \uae40\uc601\ud55c \uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uc785\ubb38 \uac15\uc758\ub97c \ub4e3\uace0 \uc791\uc131\ud55c \uae00\uc774\ub2e4.\\n- \uc2a4\ud504\ub9c1 \ubd80\ud2b8\ub97c \ud1b5\ud574\uc11c \uc190\uc27d\uac8c \uc2a4\ud504\ub9c1 \ud504\ub808\uc784\uc6cc\ud06c\ub97c \ud65c\uc6a9\ud55c \uc6f9 \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158 \uc11c\ubc84\ub97c \ub9cc\ub4e0\ub2e4.\\n- \ud074\ub77c\uc774\uc5b8\ud2b8 \uc0ac\uc774\ub4dc\uc778 \uc6f9 \ube0c\ub77c\uc6b0\uc800\uac00 \ubcf4\ub0b4\ub294 \uc694\uccad\uc744 \ub0b4\uc7a5 \ud1b0\ucea3 \uc11c\ubc84\ub97c \ud1b5\ud574 \uc2a4\ud504\ub9c1 \ucee8\ud14c\uc774\ub108\uc5d0\uc11c \ucc98\ub9ac\ud558\uc5ec \ubc18\ud658 \uc2dc\ud0a8\ub2e4.\\n\\n# \uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uad6c\uc131\uc694\uc18c \ud1ba\uc544\ubcf4\uae30\\n\\n## \ub0b4\uc7a5 \ud1b0\ucea3 \uc11c\ubc84\\n- \uc544\ud30c\uce58 \uc18c\ud504\ud2b8\uc6e8\uc5b4 \uc7ac\ub2e8\uc5d0\uc11c \ub9cc\ub4e0 WAS, \uc6f9 \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc774\ub2e4.\\n- \uc790\ubc14 \uc11c\ube14\ub9bf\uacfc JSP, JavaServer Pages\ub97c \uc2e4\ud589\ud560 \uc218 \uc788\ub294 \ud658\uacbd\uc744 \uc81c\uacf5\ud55c\ub2e4.\\n- Jakarta Servlet, Jakata Server Pages, Jakarta Expression Language \ub4f1\uc758 \uc0ac\uc591\uc744 \uad6c\ud604\ud55c \uc624\ud508\uc18c\uc2a4 \uc18c\ud504\ud2b8\uc6e8\uc5b4\uc774\ub2e4.\\n\\n### \uc544\ud30c\uce58\uc640 \ud1b0\ucea3\uc758 \ucc28\uc774\uc810\\n- \uc544\ud30c\uce58 \uc18c\ud504\ud2b8\uc6e8\uc5b4 \uc7ac\ub2e8\uc758 \uc544\ud30c\uce58 \uc6f9 \uc11c\ubc84\uc774\ub2e4.\\n- \uc815\uc801 \ub370\uc774\ud130\uc778 HTML, CSS, \uc774\ubbf8\uc9c0 \ub4f1\uc744 \ucc98\ub9ac\ud558\ub294\ub370 \ube60\ub974\uc9c0\ub9cc\\n- \ud1b0\ucea3\uc740 WAS\ub85c\uc11c JSP, \uc11c\ube14\ub9bf \ucc98\ub9ac, DB \uc5f0\uacb0 \ubc0f \ub370\uc774\ud130 \uc870\uc791 \ub4f1\uc758 \ub3d9\uc801\uc778 \ub370\uc774\ud130\ub97c \ucc98\ub9ac\ud558\ub294\ub370 \uc801\ud569\ud558\ub2e4.\\n\\n## \uc815\uc801 / \ub3d9\uc801 \ub370\uc774\ud130\\n\\n### \uc815\uc801 \ub370\uc774\ud130\\n- \uc0ac\uc6a9\uc790\uc758 \uc694\uccad\uc5d0 \ub530\ub77c \ubcc0\ud558\uc9c0 \uc54a\ub294 \ub370\uc774\ud130\uc774\ub2e4.\\n- HTML, CSS, \uc774\ubbf8\uc9c0 \ud30c\uc77c\uacfc \uac19\uc740 \ub370\uc774\ud130\ub97c \ub9d0\ud558\uba70, \uc815\uc801\uc778 \ub370\uc774\ud130\ub294 \uc6f9 \uc11c\ubc84\ub97c \ud1b5\ud574\uc11c \ucc98\ub9ac\ub41c\ub2e4.\\n\\n### \ub3d9\uc801 \ub370\uc774\ud130\\n- \uc0ac\uc6a9\uc790\uc758 \uc694\uccad\uc5d0 \ub530\ub77c \ubcc0\ud558\ub294 \ub370\uc774\ud130\ub97c \uc758\ubbf8\ud55c\ub2e4.\\n- \uc0ac\uc6a9\uc790\uac00 \uc785\ub825\ud55c \uc815\ubcf4\ub97c \ubc14\ud0d5\uc73c\ub85c DB\uc5d0\uc11c \uc815\ubcf4\ub97c \uac80\uc0c9\ud558\uac70\ub098 \uc870\uc791\ud558\uc5ec \ubc18\ud658\ub418\ub294 \ub370\uc774\ud130\ub4e4\uc744 \ub9d0\ud55c\ub2e4.\\n- \uc774\ub7ec\ud55c \ub3d9\uc801 \ub370\uc774\ud130\ub294 WAS\uc5d0\uc11c \ucc98\ub9ac\ub41c\ub2e4.\\n\\n## \uc6f9 \uc11c\ubc84\uc640 \uc6f9 \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158 \uc11c\ubc84, WAS\uc640\uc758 \ucc28\uc774\uc810\\n\\n# \uc2a4\ud504\ub9c1 \ucee8\ud14c\uc774\ub108\uc640 \ube48\\n- \uc2a4\ud504\ub9c1\uc5d0\uc11c, \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc758 \uc911\ucd94\ub97c \uad6c\uc131\ud558\ub294 \uac1d\uccb4\uc640 \uc2a4\ud504\ub9c1 Ioc \ucee8\ud14c\uc774\ub108\uc5d0\uc11c \uad00\ub9ac\ub418\ub294 \uac1d\uccb4\ub4e4\uc744 \ube48\uc774\ub77c\uace0 \ud55c\ub2e4.\\n- \ube48\uc740 \uac04\ub2e8\ud788 \uad6c\uccb4\ud654\ub41c \uac1d\uccb4\ub85c \uc2a4\ud504\ub9c1 IoC \ucee8\ud14c\uc774\ub108\uc5d0 \uc758\ud574 \uc870\ub9bd\ub418\uac70\ub098 \uad00\ub9ac\ub418\uc5b4\uc9c4\ub2e4.\\n- \uc774\ub7f0 \ube48\uacfc \uadf8\uac83\ub4e4 \uac04\uc758 \uc758\uc874\uad00\uacc4\uac00 \ucee8\ud14c\uc774\ub108\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 Configuration \uba54\ud0c0\ub370\uc774\ud130\uc5d0 \ubc18\uc601\ub41c\ub2e4.\\n\\n## \ucee8\ud14c\uc774\ub108\\n\\n### BeanFactory\\n- org.springframework.beans.factory.BeanFactory\ub294 \uc2a4\ud504\ub9c1 IoC \ucee8\ud14c\uc774\ub108\uc758 \uc2e4\uccb4\uc758 \ub300\ud45c\uc774\ub2e4.\\n- \uc2a4\ud504\ub9c1 IoC \ucee8\ud14c\uc774\ub108\ub294 \uc55e\uc11c \uc5b8\uae09\ud588\ub358 \ube48\ub4e4\uc744 \ub2f4\uac70\ub098 \uad00\ub9ac\ud558\ub294 \ucc45\uc784\uc774 \uc788\ub2e4.\\n- BeanFractory \uc778\ud130\ud398\uc774\uc2a4\ub294 \uc2a4\ud504\ub9c1\uc758 \uc911\uc2ec IoC \ucee8\ud14c\uc774\ub108 \uc778\ud130\ud398\uc774\uc2a4\uc774\ub2e4. \\n- \uc2a4\ud504\ub9c1\uc73c\ub85c \ubc14\ub85c \uc81c\uacf5\ub418\uc5b4\uc9c0\ub294 BeanFactory \uc778\ud130\ud398\uc774\uc2a4\uc758\ub2e4\uc591\ud55c \uad6c\ud604\ub4e4\uc774 \uc788\ub2e4.\\n- \uac00\uc7a5 \ub9ce\uc774 \uc4f0\uc774\ub294 \uad6c\ud604\uc774 XmlBeanFactory \ud074\ub798\uc2a4\uc774\ub2e4.\\n- \uc774 \uad6c\ud604\uc740 \uc6b0\ub9ac\uac00 \uc571\uc744 \uad6c\uc131\ud558\ub294 \uac1d\uccb4\ub4e4\uacfc \uc758\uc2ec\ud560 \uc5ec\uc9c0\uc5c6\uc774 \ub9ce\uc740 \uac1d\ucc44\ub4e4 \uac04\uc758 \uc0c1\ud638 \uc758\uc874\uad00\uacc4\ub97c XML\uc758 \uc5b8\uc5b4\ub85c \ud45c\ud604\ud558\ub3c4\ub85d \ud55c\ub2e4.\\n- XmlBeanFactory\ub294 XML Configuration \uba54\ud0c0\ub370\uc774\ud130\ub97c \ucde8\ud574\uc11c \uc644\uc804\ud558\uac8c \ud658\uacbd\uc124\uc815\ub41c \uc2dc\uc2a4\ud15c\uc774\ub098 \uc571\uc744 \ub9cc\ub4dc\ub294\ub370 \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n![](https://docs.spring.io/spring-framework/docs/3.0.0.M3/reference/html/images/container-magic.png)\\n[4.2 Basics - containers and beans](https://docs.spring.io/spring-framework/docs/3.0.0.M3/reference/html/ch04s02.html)\\n\\n### ApplicationContext\\n- ApplicationContext \uc778\ud130\ud398\uc774\uc2a4\ub3c4 \uc2a4\ud504\ub9c1 IoC \ucee8\ud14c\uc774\ub108\ub97c \ub300\ud45c\ud558\uace0 \uad6c\ud604, \ud658\uacbd\uc124\uc815, \ube48\uc744 \uc870\ud569\ud558\ub294 \uc5ed\ud560\uc744 \uc218\ud589\ud55c\ub2e4.\\n- BeanFactory\uc758 \ub300\uccb4 \uc778\ud130\ud398\uc774\uc2a4\ub85c \ub354 \ub9ce\uc740 \uae30\uc5c5\uc5d0 \ud2b9\ud654\ub41c \uae30\ub2a5\ub4e4\uc744 \uc81c\uacf5\ud55c\ub2e4.\\n- \uc81c\uacf5\ub418\ub294 \uae30\ub2a5\uc73c\ub85c \uba54\uc2dc\uc9c0 \ud655\uc778(\ub2e4\uad6d\uc5b8\uc5b4 \uc9c0\uc6d0), \uc774\ubca4\ud2b8 \uac8c\uc2dc, \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158 \ub808\uc774\uc5b4 \ud2b9\ud654 \ubb38\ub9e5\uc774 \uc788\ub2e4.\\n- \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158 \ucef4\ud3ec\ub10c\ud2b8\uc5d0 \uc811\uadfc\ud560 \ub54c \uc0ac\uc6a9\ud558\ub294 ListableBeanFactory \uba54\uc11c\ub4dc\ub97c \uc0c1\uc18d \ubc1b\uc558\uace0\\n- \uc77c\ubc18\uc801\uc778 \ubc29\ubc95\uc73c\ub85c \ud30c\uc77c \ub9ac\uc2a4\uc18c\ub97c \uc77d\ub294 \uae30\ub2a5\uc744 ResourceLoader\ub85c\ubd80\ud130 \uc0c1\uc18d \ubc1b\uc558\ub2e4.\\n- ApplicationEventPublisher\ub85c\ubd80\ud130 \uc0c1\uc18d\ubc1b\uc740 \ub4f1\ub85d\ub41c \ub9ac\uc2a4\ub108\ub4e4\uc758 \uc774\ubca4\ud2b8\ub97c \uac8c\uc2dc\ud558\ub294 \ub2a5\ub825\ub3c4 \uac00\uc9c0\uace0 \uc788\ub2e4.\\n\\n## \ucee8\ud2b8\ub864\ub7ec\ub780 \ubb34\uc5c7\uc778\uac00?\\n- \uc804\ud615\uc801\uc778 MVC, Model-View-Controller \uc544\ud0a4\ud14d\ucc98\uc5d0\uc11c Controller\uc758 \uac1c\ub150\uc744 \ub4e4\uc5ec\ub2e4\ubcf4\uc790.\\n\\n### \ucee8\ud2b8\ub864\ub7ec\uc758 \uc5ed\ud560\\n- \ub4e4\uc5b4\uc624\ub294 \uc751\ub2f5\uc744 \uac00\ub85c\ucc48\ub2e4.\\n- \uc751\ub2f5\uc758 \ub0b4\uc6a9\uc744 \ub370\uc774\ud130 \ub0b4\ubd80 \uccb4\uacc4\ub85c \ubcc0\ud658\uc2dc\ud0a8\ub2e4.\\n- \ucd94\uac00\uc758 \ucc98\ub9ac\ub97c \uc704\ud55c \ubaa8\ub378\uc5d0 \ub370\uc774\ud130\ub97c \ubcf4\ub0b8\ub2e4.\\n- \ubaa8\ub378\ub85c\ubd80\ud130 \ucc98\ub9ac\ub41c \ub370\uc774\ud130\ub97c \uc5bb\uc5b4\uc640 \ub80c\ub354\ub9c1\uc744 \uc704\ud574 \ud574\ub2f9 \ub370\uc774\ud130\ub97c \ubdf0\ub85c \uc804\ub2ec\ud55c\ub2e4.\\n\\n**\uc2a4\ud504\ub9c1 MVC \ub2e4\uc774\uc5b4\uadf8\ub7a8**\\n![](./dispatching-servlet.png)\\n\\n- \uc5ec\uae30\uc11c \ubc1c\uc1a1 \uc11c\ube14\ub9bf\uc774 \uc544\ud0a4\ud14d\ucc98\uc5d0\uc11c Front \ucee8\ud2b8\ub864\ub7ec\uc758 \uc5ed\ud560\uc744 \uc218\ud589\ud55c\ub2e4.\\n- \uc704 MCV \ub2e4\uc774\uc5b4\uadf8\ub7a8\uc774 \uc804\ud615\uc801\uc778 MCV \ucee8\ud2b8\ub864\ub7ec \ubfd0\ub9cc\uc544\ub2c8\ub77c RESTful \ucee8\ud2b8\ub864\ub7ec\uc5d0 \ud574\ub2f9\ub41c\ub2e4. (\uc57d\uac04\ub9cc \ub2e4\ub974\ub2e4.)\\n- \uc804\ud1b5\uc801\uc778 \uc811\uadfc\ubc95\uc73c\ub85c MVC \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc740 \uc11c\ube44\uc2a4 \uc9c0\ud5a5\uc774 \uc544\ub2c8\ub77c\uc11c \ubdf0 \ub9ac\uc878\ubc84\ub97c \ud1b5\ud574 \ucee8\ud2b8\ub864\ub7ec\ub85c\ubd80\ud130 \uc5bb\uc5b4\ub0b8 \ub370\uc774\ud130\ub97c \uae30\ubc18\uc73c\ub85c \ucd5c\uc885 \ubdf0\ub97c \ub80c\ub354\ub9c1\ud55c\ub2e4.\\n- RESTful \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc740 \uc11c\ube44\uc2a4 \uc9c0\ud5a5\uc73c\ub85c \ub514\uc790\uc778\ub418\uc5b4\uc11c \uc6d0\ubcf8 \ub370\uc774\ud130(\uc8fc\ub85c JSON)\uc744 \ubc18\ud658\ud55c\ub2e4.\\n- \uc774\ub7ec\ud55c \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc774 \uc5b4\ub5a0\ud55c \ubdf0 \ub80c\ub354\ub9c1\ub3c4 \ud558\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc5d0, \ubdf0 \ub9ac\uc878\ubc84\uac00 \uc874\uc7ac\ud558\uc9c0 \uc54a\ub294\ub2e4.\\n- \uadf8\ub798\uc11c \ucee8\ud2b8\ub864\ub7ec\uac00 \uc77c\ubc18\uc801\uc73c\ub85c \uc9c1\uc811 HTTP \uc751\ub2f5\uc744 \ud1b5\ud574 \ub370\uc774\ud130\ub97c \uc804\uc1a1\ud560 \uac83\uc73c\ub85c \uae30\ub300\ud55c\ub2e4.\\n[\ucd9c\ucc98](https://www.baeldung.com/spring-controllers)\\n\\n# Maven Dependencies\\n- Maven\uc740 \ube4c\ub4dc \uc790\ub3d9\ud654 \ub3c4\uad6c\ub85c \uc8fc\ub85c \uc790\ubc14 \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c \uc4f0\uc778\ub2e4.\\n- \uc2a4\ud504\ub9c1\uc5d0\uc11c\ub294 Maven\uc774 \uc758\uc874\uc131\ub4e4\uc744 \uad6c\uc131\ud558\uace0 \ud504\ub85c\uc81d\ud2b8\ub97c \ube4c\ub4dc\ud558\ub294\ub370 \uc0ac\uc6a9\ub41c\ub2e4.\\n- \ub2e4\uc74c\uc740 \uc2a4\ud504\ub9c1 \ubd80\ud2b8\uc5d0\uc11c \uc2a4\ud504\ub9c1 MVC\ub85c \ub3d9\uc791\ud558\uae30 \uc704\ud574\uc11c Maven \uc758\uc874\uc131\uc744 \ub2e4\ub904\ubcf8\ub2e4.\\n```\\n<dependency>\\n\\t<groupId>org.springframework.boot</groupId>\\n    <artifactId>spring-boot-starter-web</artifactId>\\n    <version>3.0.2</version>\\n</dependency>\\n```\\n\\n# \uc2a4\ud504\ub9c1 \ubd80\ud2b8 Web Config\\n- \uc2a4\ud504\ub9c1 \ubd80\ud2b8\uc5d0\uc11c \uc5b4\ub5bb\uac8c \uad6c\uc131\ud558\ub294\uc9c0 \ub4e4\uc5ec\ub2e4\ubcf4\uc790.\\n- \ud074\ub798\uc11c \uacbd\ub85c\uc5d0 thymeleaf \uc758\uc874\uc131\uc744 \ucd94\uac00\ud588\uae30 \ub54c\ubb38\uc5d0, \uc774\ub97c \uc704\ud55c \uc5b4\ub5a4 @Beans\ub3c4 \uad6c\uc131\ud560 \ud544\uc694\uac00 \uc5c6\uc2b5\ub2c8\ub2e4.\\n```\\n<dependency>\\n    <groupId>org.springframework.boot</groupId>\\n    <artifactId>spring-boot-starter-thymeleaf</artifactId>\\n</dependency>\\n```\\n- WebConfig\uc5d0\uc11c \uae30\ubcf8 \uc124\uc815 \uc11c\ube14\ub9bf\uacfc Greeting \uac1d\uccb4\uc640 \uc624\ube0c\uc81d\ud2b8 \ub9e4\ud37c\ub97c \uc704\ud55c \ube48\uc744 \uac00\ub2a5\ud558\ub3c4\ub85d \ucd94\uac00\ud574\uc900\ub2e4.\\n```\\n@Bean\\npublic WebServerFactoryCustomizer<ConfigurableServletWebServerFactory> enableDefaultServlet(){\\n\\treturn factory -> factory.setRegisterDefaultServlet(true);\\n}\\n\\n@Bean\\npublic Greeting greeting() {\\n\\tGreeting greeting = new Greeting();\\n\\tgreeting.setMessage(\\"Hello World !!\\");\\n\\treturn greeting;\\n}\\n\\n@Bean\\npublic ObjectMapper objectMapper() {\\nreturn new ObejctMapper();\\n}\\n```\\n- \uc608\ub97c\ub4e4\uc5b4, \ub9cc\uc57d \ucee8\ud2b8\ub864\ub7ec\uac00 \\"welcome\\" \uc774\ub984\uc758 \ubdf0\ub97c \ubc18\ud658\ud558\uba74, \ubdf0 \ub9ac\uc878\ubc84\ub294 \ud15c\ud50c\ub9bf \ud3f4\ub354 \uc548\uc5d0 \\"welcome.html\\"\uc774\ub77c \ubd88\ub9ac\ub294 \ud398\uc774\uc9c0\ub97c \ucc98\ub9ac\ud55c\ub2e4.\\n- \ud15c\ud50c\ub9bf \ud3f4\ub354\uac00 thymeleaf\uac00 \ubdf0\ub97c \ucc3e\ub3c4\ub85d \uae30\ubcf8 \uc124\uc815\ub41c \ud3f4\ub354\uc774\ub2e4.\\n\\n# MVC \ucee8\ud2b8\ub864\ub7ec\\n- MVC \uc2a4\ud0c0\uc77c\uc758 \ucee8\ud2b8\ub864\ub7ec\ub97c \uad6c\ud604\ud558\uc790\\n- \uc5b4\ub5bb\uac8c ModelAndView \uac1d\uccb4\ub97c \ubc18\ud658\ud558\ub294\uc9c0 \uc8fc\ubaa9\ud558\uc790.\\n- ModelAndView \uac1d\uccb4\ub294 \ubaa8\ub378 \ub9f5\uacfc \ubdf0 \uac1d\uccb4\ub97c \ud3ec\ud568\ud558\uace0 \ub458\ub2e4 \ubdf0 \ub9ac\uc878\ubc84\uc5d0\uc11c \ub370\uc774\ud130 \ub80c\ub354\ub9c1\uc5d0 \uc0ac\uc6a9\ub41c\ub2e4.\\n\\n```\\n@Controller\\n@RequestMapping(value= \\"/test\\")\\npublic class TestController {\\n\\t@GetMapping\\n\\tpublic ModelAndView getTestData() {\\n\\t\\tModelAndView mv = new ModelAndView();\\n\\t\\tmv.setViewName(\\"welcome\\");\\n\\t\\tmv.getModel().put(\\"data\\", \\"Welcome Home man\\");\\n\\t\\treturn mv;\\n\\t}\\n}\\n```\\n- \uc5ec\uae30\uae4c\uc9c0 \uc815\ud655\ud558\uac8c \uad6c\ucd95\ud55c\uac8c \uc5ec\uae30\uc788\ub2e4.\\n- \uba3c\uc800 TestController\ub77c\uace0 \ubd88\ub9ac\ub294 \ucee8\ud14c\uc774\ub108\ub97c \ub9cc\ub4e4\uace0 \uadf8\uac83\uc744 \\"/test\\" \uacbd\ub85c\uc5d0 \ub9e4\ud551\ud588\ub2e4.\\n- \ud074\ub798\uc2a4\uc5d0\uc11c, ModelAndView \uac1d\uccb4\ub97c \ubc18\ud658\ud558\ub294 \uba54\uc11c\ub4dc\ub97c \ub9cc\ub4e4\uace0\\n- GET \uc694\uccad\uc744 \ud1b5\ud574\uc11c \uba54\uc11c\ub4dc\ub97c \ud328\ubc0d\ud558\uc5ec \\"test\\"\ub85c \ub05d\ub098\ub294 URL \ud638\ucd9c\uc774 \ubc1c\uc1a1 \uc11c\ube14\ub9bf\uc73c\ub85c \ub77c\uc6b0\ud305\ub418\uc5b4 TestContoller\uc758 getTestData \uba54\uc11c\ub4dc\ub85c \uc804\ub2ec\ub429\ub2c8\ub2e4.\\n\\n- \ubb3c\ub860 ModelAndView \uac1d\uccb4\uc5d0 \ucd94\uac00\ub85c \uba87\uba87 \ubaa8\ub378 \ub370\uc774\ud130\ub3c4 \ubc18\ud658\ud55c\ub2e4.\\n- \ubdf0 \uac1d\uccb4\ub294 \\"welcome\\"\uc73c\ub85c \uc124\uc815\ub418\uc5c8\uace0 \uc704\uc5d0\uc11c \uc5b8\uae09\ud55c\ub300\ub85c, \ubdf0 \ub9ac\uc878\ubc84\uac00 \ud15c\ud50c\ub9bf \ud3f4\ub354 \uc548\uc5d0 \'welcome.html\'\uc73c\ub85c \ubd88\ub9ac\ub294 \ud398\uc774\uc9c0\ub97c \ucc3e\ub294\ub2e4.\\n\\n# REST \ucee8\ud2b8\ub864\ub7ec\\n- \uc2a4\ud504\ub9c1 RESTful \uc5b4\ud50c\ub9ac\ucf00\uc774\uc158 \uad6c\ucd95\uc740 MVC\uc5b4\ud50c\ub9ac\ucf00\uc774\uc158\uc758 \uac83\uacfc \ubdf0\ub9ac\uc878\ubc84\uc640 \ubaa8\ub378 \ub9f5\uc774 \uc5c6\ub2e4\ub294 \uac83 \ube7c\uace0\ub294 \uac19\ub2e4.\\n- API\uac00 \uac04\ub2e8\ud788 JSON\uacfc \uac19\uc740 \ubc29\uc2dd\uc758 \uc6d0\ubcf8 \ub370\uc774\ud130\ub85c \ud074\ub77c\uc774\uc5b8\ud2b8\uc5d0\uac8c \ubc18\ud658\ud55c\ub2e4.\\n- \uadf8\ub798\uc11c \ubc1c\uc1a1 \uc11c\ube14\ub9bf\uc774 \ubdf0 \ub9ac\uc878\ubc84\ub97c \uc6b0\ud68c\ud558\uc5ec HTTP \uc751\ub2f5 \ubc14\ub514\uc758 \ub370\uc774\ud130\ub97c \ubc14\ub85c \ubc18\ud658\ud55c\ub2e4.\\n- \uac04\ub2e8\ud55c RESTful controller\uc758 \uad6c\ud604\uc744 \ubcf4\uc790.\\n```\\n@RestContorller\\npublic class Restcontroller {\\n\\t@GetMapping(value = \\"/student/{studentId}\\")\\n\\tpublic Student getTestData(@PathVariable Integer studentId) {\\n\\t\\tStudent student = new Student();\\n\\t\\tstudent.setName(\\"Peter\\");\\n\\t\\tstudent.setId(student.ID);\\n\\t\\treturn student;\\n\\t}\\n}\\n```"},{"id":"greetings","metadata":{"permalink":"/blog/greetings","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2023-03-18-greetings.md","source":"@site/blog/2023-03-18-greetings.md","title":"Greetings!","description":"Congratulations, you have made your first post!","date":"2023-03-18T00:00:00.000Z","formattedDate":"2023\ub144 3\uc6d4 18\uc77c","tags":[{"label":"greetings","permalink":"/blog/tags/greetings"}],"readingTime":0.1,"hasTruncateMarker":false,"authors":[{"name":"Joel Marcey","title":"Co-creator of Docusaurus 1","url":"https://github.com/JoelMarcey","image_url":"https://github.com/JoelMarcey.png","imageURL":"https://github.com/JoelMarcey.png"},{"name":"Sebastien Lorber","title":"Docusaurus maintainer","url":"https://sebastienlorber.com","image_url":"https://github.com/slorber.png","imageURL":"https://github.com/slorber.png"}],"frontMatter":{"slug":"greetings","title":"Greetings!","authors":[{"name":"Joel Marcey","title":"Co-creator of Docusaurus 1","url":"https://github.com/JoelMarcey","image_url":"https://github.com/JoelMarcey.png","imageURL":"https://github.com/JoelMarcey.png"},{"name":"Sebastien Lorber","title":"Docusaurus maintainer","url":"https://sebastienlorber.com","image_url":"https://github.com/slorber.png","imageURL":"https://github.com/slorber.png"}],"tags":["greetings"]},"unlisted":false,"prevItem":{"title":"\uc2a4\ud504\ub9c1 \ubd80\ud2b8 \uad6c\uc131\uc694\uc18c \uc0b4\ud3b4\ubcf4\uae30","permalink":"/blog/spring-boot-component-research"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"Congratulations, you have made your first post!\\n\\nFeel free to play around and edit this post as much you like."},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/leetaehwan/leetaehwan.github.io/edit/main/blog/2021-08-26-welcome/index.md","source":"@site/blog/2021-08-26-welcome/index.md","title":"Welcome","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2021-08-26T00:00:00.000Z","formattedDate":"2021\ub144 8\uc6d4 26\uc77c","tags":[{"label":"facebook","permalink":"/blog/tags/facebook"},{"label":"hello","permalink":"/blog/tags/hello"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.405,"hasTruncateMarker":false,"authors":[{"name":"S\xe9bastien Lorber","title":"Docusaurus maintainer","url":"https://sebastienlorber.com","imageURL":"https://github.com/slorber.png","key":"slorber"},{"name":"Yangshun Tay","title":"Front End Engineer @ Facebook","url":"https://github.com/yangshun","imageURL":"https://github.com/yangshun.png","key":"yangshun"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["slorber","yangshun"],"tags":["facebook","hello","docusaurus"]},"unlisted":false,"prevItem":{"title":"Greetings!","permalink":"/blog/greetings"}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."}]}')}}]);